RE = {
	tDelayCall = {},
}
local _RE = {}
function RE.Talk(nChannel,szText)
	local szTarget, me = "", GetClientPlayer()
	-- channel
	if not nChannel then
		nChannel = PLAYER_TALK_CHANNEL.RAID
	elseif type(nChannel) == "table" then
		szText = nChannel
		nChannel = PLAYER_TALK_CHANNEL.RAID
	elseif type(nChannel) == "string" then
		if not szText then
			szText = nChannel
			nChannel = PLAYER_TALK_CHANNEL.RAID
		else
			szTarget = nChannel
			nChannel = PLAYER_TALK_CHANNEL.WHISPER
		end
	elseif nChannel == PLAYER_TALK_CHANNEL.RAID and me.GetScene().nType == MAP_TYPE.BATTLE_FIELD then
		nChannel = PLAYER_TALK_CHANNEL.BATTLE_FIELD
	end
	local tSay = nil
	if type(szText) == "table" then
		tSay = szText
	else
		tSay = {{ type = "text", text = szText .. "\n"}}
	end
	me.Talk(nChannel,szTarget,tSay)
end
RE.UrlEncode = function(szText)
	local str = szText:gsub("([^0-9a-zA-Z ])", function (c) return string.format ("%%%02X", string.byte(c)) end)
	str = str:gsub(" ", "+")
	return str
end
RE.RemoteRequest = function(szUrl, fnAction)
	local page = Station.Lookup("Normal/RaidGrid_EventScrutiny/Page_1")
	if page then
		page:Navigate(szUrl)
		RE.DelayCall(500,function()
			local szUrl, szTitle = page:GetLocationURL(), page:GetLocationName()
			if szUrl ~= szTitle then
				fnAction(szTitle)
			end
		end)
	end
end

RE.DelayCall = function(nDelay, fnAction)
	local nTime = nDelay + GetTime()
	table.insert(RE.tDelayCall, { nTime = nTime, fnAction = fnAction })
end


