function RaidGrid_Base.TeamMark(Tid, Marktype)
	if RaidGrid_EventScrutiny.bFunctionPcallRunMode then
		local status, err = pcall(RaidGrid_Base.TeamMarkOrg, Tid, Marktype)
		if RaidGrid_EventScrutiny.bFunctionPcallErrOutput and not status and err then
			Output(err, "RaidGrid_Base.TeamMark", Tid, Marktype)
		end
	else
		RaidGrid_Base.TeamMarkOrg(Tid, Marktype)
	end
end

function RaidGrid_Base.TeamMarkOrg(Tid, Marktype)
	local player = GetClientPlayer()
	if player.IsInParty() then
		local hTeam = GetClientTeam()
		if player.dwID == hTeam.GetAuthorityInfo(TEAM_AUTHORITY_TYPE.MARK) then -- Party Mark
			local tPartyMark = hTeam.GetTeamMark()
			if tPartyMark[Tid] ~= nil and tPartyMark[Tid] ~= 0 then
				return
			end
			hTeam.SetTeamMark(Marktype, Tid)
		end
	end
end
	
function RaidGrid_Base.HideTip()
	if HideTip then
		HideTip()
	end
end

function RaidGrid_Base.AdjustToOriginalPos(xScreen, yScreen)
	if Station then
		if Station.AdjustToOriginalPos then
			return Station.AdjustToOriginalPos(xScreen, yScreen)
		elseif Station.GetUIScale then
			local nUIScale = Station.GetUIScale()
			return xScreen/nUIScale, yScreen/nUIScale
		end
	end
	return xScreen, yScreen
end

function RaidGrid_Base.ToGetNpcIntensity(npc)
	if GetNpcIntensity then
		return GetNpcIntensity(npc)
	else
		if not npc then
			return 1
		end
		local n = npc.nIntensity
		if not n then
			return 4
		end
		if n == 2 or n == 6 then --领袖
			return 4
		elseif n == 5 then --头目
			return 3
		elseif n == 4 then -- 高手
			return 2
		end
		return 1 --普通
	end
end

function RaidGrid_Base.SetTarget(dwTargetID)
	if RaidGrid_EventScrutiny.bFunctionPcallRunMode then
		local status, err = pcall(RaidGrid_Base.SetTargetOrg, dwTargetID)
		if RaidGrid_EventScrutiny.bFunctionPcallErrOutput and not status and err then
			Output(err, "RaidGrid_Base.SetTarget", dwTargetID)
		end
	else
		RaidGrid_Base.SetTargetOrg(dwTargetID)
	end
end

function RaidGrid_Base.SetTargetOrg(dwTargetID)
	local player = GetClientPlayer()
	if not player then
		return
	end
	
	local nType = TARGET.NPC
	if not dwTargetID or (dwTargetID <= 0) then
		nType = TARGET.NO_TARGET
		dwTargetID = 0
	elseif IsPlayer(dwTargetID) then
		nType = TARGET.PLAYER
	end
	
	if SetTarget then
		local as0, as1 = arg0, arg1
		SetTarget(nType, dwTargetID)
		arg0, arg1 = as0, as1
	elseif SelectTarget then
		SelectTarget(nType, dwTargetID)
	end

end

function RaidGrid_Base.GetNpcTeamMarkName(Tid)
	local player = GetClientPlayer()
	if not player then
		return Tid
	end
	if player.IsInParty() then
		local hTeam = GetClientTeam()
		if not hTeam then
			return Tid
		end
		local tPartyMark = hTeam.GetTeamMark()
		if not tPartyMark then
			return Tid
		end
		local nMarkID = tPartyMark[Tid]
		if nMarkID and nMarkID ~= 0 then
			if nMarkID > 0 and nMarkID < 11 then
				return RaidGrid_Base.tMarkName[nMarkID]
			end
		end
	end
	return Tid
end

