function RaidGrid_Base.VersionUpdate(beforced)
	if not RaidGrid_EventScrutiny or not RaidGrid_EventCache then return end
	
	if not beforced and RaidGrid_Base.version == 2 then return end
	
	if not RaidGrid_EventCache.tRecords.Buff.Hash2 then RaidGrid_EventCache.tRecords.Buff.Hash2 = {} end
	if not RaidGrid_EventCache.tRecords.Debuff.Hash2 then RaidGrid_EventCache.tRecords.Debuff.Hash2 = {} end
	if not RaidGrid_EventCache.tRecords.Npc.Hash2 then RaidGrid_EventCache.tRecords.Npc.Hash2 = {} end
	if not RaidGrid_EventCache.tRecords.Casting.Hash2 then RaidGrid_EventCache.tRecords.Casting.Hash2 = {} end
	
	if not RaidGrid_EventScrutiny.tRecords.Buff.Hash2 then RaidGrid_EventScrutiny.tRecords.Buff.Hash2 = {} end
	if not RaidGrid_EventScrutiny.tRecords.Debuff.Hash2 then RaidGrid_EventScrutiny.tRecords.Debuff.Hash2 = {} end
	if not RaidGrid_EventScrutiny.tRecords.Npc.Hash2 then RaidGrid_EventScrutiny.tRecords.Npc.Hash2 = {} end
	if not RaidGrid_EventScrutiny.tRecords.Casting.Hash2 then RaidGrid_EventScrutiny.tRecords.Casting.Hash2 = {} end
	if not RaidGrid_EventScrutiny.tRecords.Scrutiny.Hash2 then RaidGrid_EventScrutiny.tRecords.Scrutiny.Hash2 = {} end

	local function RaidGrid_Base_HashChange(tRecords)
		for k,v in pairs(tRecords) do
			if v.dwID and v.nLevel and tRecords.Hash[v.dwID] then
				tRecords.Hash2[v.dwID] = tRecords.Hash2[v.dwID] or {}
				tRecords.Hash2[v.dwID][v.nLevel] = true
			end
		end
	end

	RaidGrid_Base_HashChange(RaidGrid_EventCache.tRecords.Buff)
	RaidGrid_Base_HashChange(RaidGrid_EventCache.tRecords.Debuff)
	RaidGrid_Base_HashChange(RaidGrid_EventCache.tRecords.Casting)
	
	RaidGrid_Base_HashChange(RaidGrid_EventScrutiny.tRecords.Buff)
	RaidGrid_Base_HashChange(RaidGrid_EventScrutiny.tRecords.Debuff)
	RaidGrid_Base_HashChange(RaidGrid_EventScrutiny.tRecords.Casting)
	RaidGrid_Base_HashChange(RaidGrid_EventScrutiny.tRecords.Scrutiny)

	if RaidGrid_Base.version == 1 then
		RaidGrid_Base.version = 2
		RaidGrid_Base.Message("Chào mừng bạn đến với RGES, đang tải dữ liệu ban đầu....")
		RaidGrid_Base.LoadSettingsFileNew("rges_settings_new.alldat", true)
	end
	--RaidGrid_Base.Message("成功升级dữ liệu到第二版，请小退重进游戏.")
end

