function RaidGrid_Base.tRecordsRepair()
	if not RaidGrid_EventScrutiny or not RaidGrid_EventCache then return end

	RaidGrid_EventCache.tRecords.Buff.Hash = {}
	RaidGrid_EventCache.tRecords.Debuff.Hash = {}
	RaidGrid_EventCache.tRecords.Npc.Hash = {}
	RaidGrid_EventCache.tRecords.Casting.Hash = {}
	
	RaidGrid_EventScrutiny.tRecords.Buff.Hash = {}
	RaidGrid_EventScrutiny.tRecords.Debuff.Hash = {}
	RaidGrid_EventScrutiny.tRecords.Npc.Hash = {}
	RaidGrid_EventScrutiny.tRecords.Casting.Hash = {}
	RaidGrid_EventScrutiny.tRecords.Scrutiny.Hash = {}
	
	RaidGrid_EventCache.tRecords.Buff.Hash2 = {}
	RaidGrid_EventCache.tRecords.Debuff.Hash2 = {}
	RaidGrid_EventCache.tRecords.Npc.Hash2 = {}
	RaidGrid_EventCache.tRecords.Casting.Hash2 = {}
	
	RaidGrid_EventScrutiny.tRecords.Buff.Hash2 = {}
	RaidGrid_EventScrutiny.tRecords.Debuff.Hash2 = {}
	RaidGrid_EventScrutiny.tRecords.Npc.Hash2 = {}
	RaidGrid_EventScrutiny.tRecords.Casting.Hash2 = {}
	RaidGrid_EventScrutiny.tRecords.Scrutiny.Hash2 = {}

	local function RaidGrid_Base_HashRepair(tRecords)
		for k,v in pairs(tRecords) do
			if v.dwID then
				tRecords.Hash[v.dwID] = true
				if v.nLevel then
					tRecords.Hash2[v.dwID] = tRecords.Hash2[v.dwID] or {}
					tRecords.Hash2[v.dwID][v.nLevel] = true
				end
			end
		end
	end

	RaidGrid_Base_HashRepair(RaidGrid_EventCache.tRecords.Buff)
	RaidGrid_Base_HashRepair(RaidGrid_EventCache.tRecords.Debuff)
	RaidGrid_Base_HashRepair(RaidGrid_EventCache.tRecords.Npc)
	RaidGrid_Base_HashRepair(RaidGrid_EventCache.tRecords.Casting)
	
	RaidGrid_Base_HashRepair(RaidGrid_EventScrutiny.tRecords.Buff)
	RaidGrid_Base_HashRepair(RaidGrid_EventScrutiny.tRecords.Debuff)
	RaidGrid_Base_HashRepair(RaidGrid_EventScrutiny.tRecords.Casting)
	RaidGrid_Base_HashRepair(RaidGrid_EventScrutiny.tRecords.Npc)
	RaidGrid_Base_HashRepair(RaidGrid_EventScrutiny.tRecords.Scrutiny)

	RaidGrid_Base.Message("Sửa chữa dữ liệu thành công, vui lòng đăng nhập lại.")
end

