function RaidGrid_Base.GetEventMaxMarkCount(handleRecord)
	if not handleRecord then
		return
	end
	local Recall = function(szText)
		if not szText or szText == "" then
			return
		end
		local nNum = tonumber(szText)
		if not nNum then
			return
		end
		handleRecord.tRecord.nMaxMarkCount = nil
		if nNum > 1 and nNum < 10 then
			handleRecord.tRecord.nMaxMarkCount = nNum
		end
		RaidGrid_EventScrutiny.UpdateRecordList(RaidGrid_EventScrutiny.szListIndex)
	end
	GetUserInput(handleRecord.tRecord.szName.." Tự động đánh dấu tất cả các mục tiêu", Recall, nil, function() end, nil, handleRecord.tRecord.nMaxMarkCount or 10, 10)
end

