function RaidGrid_Base.CheckTeamVersion()
	local me = GetClientPlayer()
	if me.IsInParty() then
		local t = 
		{
			{type = "text", text = "BG_CHANNEL_MSG"},
			{type = "text", text = "CheckEventScrutinyVersion"},
			{type = "text", text = me.szName},
		}
		RE.Talk(t)
		RaidGrid_Base.Message("Bắt đầu kiểm tra phiên bản của đồng đội...")
	else
		RaidGrid_Base.Message("Không thể kiểm tra phiên bản của người chơi ngoài nhóm.")
	end
end

