-- 发送dữ liệu给全团
function RaidGrid_Base.SendDataToTeam(data,szDataType,szClientName)
	local player = GetClientPlayer()
	
	local szDataType = szDataType or ""
	local szClientName = szClientName or "ALL"
	if player.IsInParty() then
		local team = GetClientTeam()
		local _GetName = team.GetClientTeamMemberName
		local szLeader = _GetName(team.GetAuthorityInfo(TEAM_AUTHORITY_TYPE.LEADER))
		if player.szName ~="ĐườngKiệt" then
			if szLeader ~= player.szName then
				return RaidGrid_Base.Message("Không phải đội trưởng không thể chia sẻ dữ liệu!")
			end
		end
		RaidGrid_Base.Message("Đang chia sẻ dữ liệu")
		local t =
			{
				{type = "text", text = "BG_CHANNEL_MSG"},
				{type = "text", text = "SendDataToTeamStart"},
				{type = "text", text = player.szName},
				{type = "text", text = szClientName},
			}
		RE.Talk(t)
		for k, v in pairs(data) do
			RaidGrid_Base.Message("Đang gửi "..k)
			if type(data[k]) == "table" then
				RaidGrid_Base.SendDataToTeam_Table(k,data[k])
			elseif type(data[k]) == "boolean" then
				local t =
				{
					{type = "text", text = "BG_CHANNEL_MSG"},
					{type = "text", text = "SendDataToTeam"},
					{type = "text", text = type(data[k])},
					{type = "text", text = k},
					{type = "text", text = tostring(data[k])},
				}
				RE.Talk(t)
			else
				local t =
				{
					{type = "text", text = "BG_CHANNEL_MSG"},
					{type = "text", text = "SendDataToTeam"},
					{type = "text", text = type(data[k])},
					{type = "text", text = k},
					{type = "text", text = v},
				}
				RE.Talk(t)
			end
		end
		local t =
			{
				{type = "text", text = "BG_CHANNEL_MSG"},
				{type = "text", text = "SendDataToTeamEnd"},
				{type = "text", text = player.szName},
				{type = "text", text = szDataType},
			}
		RE.Talk(t)
		RaidGrid_Base.Message("Chia sẻ dữ liệu hoàn tất!")
	else
		return RaidGrid_Base.Message("Bạn không ở trong nhóm!")
	end
end
