function RaidGrid_Base.WhisperToPartyMember(tInfo)
	if RaidGrid_EventScrutiny.bFunctionPcallRunMode then
		local status, err = pcall(RaidGrid_Base.WhisperToPartyMemberOrg, tInfo)
		if RaidGrid_EventScrutiny.bFunctionPcallErrOutput and not status and err then
			Output(err, "RaidGrid_Base.WhisperToPartyMember", tInfo)
		end
	else
		RaidGrid_Base.WhisperToPartyMemberOrg(tInfo)
	end
end

function RaidGrid_Base.WhisperToPartyMemberOrg(tInfo)
	local ClientPlayer = GetClientPlayer()
	if not ClientPlayer or not ClientPlayer.IsInParty() then
		return
	end
	local hTeam = GetClientTeam()
	local nGroupNum = hTeam.nGroupNum
	for i = 0, nGroupNum - 1 do
		local tGroupInfo = hTeam.GetGroupInfo(i)
		if tGroupInfo and tGroupInfo.MemberList then
			for _,dwID in pairs(tGroupInfo.MemberList) do
				local playerMember = hTeam.GetMemberInfo(dwID)
				if ClientPlayer.dwID ~= dwID and playerMember then
					RE.Talk(playerMember.szName,tInfo)
				end
			end
		end
	end
end

