function RaidGrid_Base.SetPanelPos(nX, nY)
	if not nX or not nY then
		RaidGrid_EventScrutiny.frameSelf:SetPoint("CENTER", 0, 0, "CENTER", 0, 0)
	else
		local nW, nH = Station.GetClientSize(true)
		if nX < 0 then nX = 0 end
		if nX > nW - 100 then nX = nW - 100 end
		if nY < 0 then nY = 0 end
		if nY > nH - 110 then nY = nH - 110 end
		RaidGrid_EventScrutiny.frameSelf:SetRelPos(nX, nY)
	end
	RaidGrid_EventScrutiny.tLastLoc.nX, RaidGrid_EventScrutiny.tLastLoc.nY = RaidGrid_EventScrutiny.frameSelf:GetRelPos()
end

function RaidGrid_Base.OutputNpcInfoTip(dwNpcTemplateID, Rect)
	local npc = GetNpcTemplate(dwNpcTemplateID)
	if not npc then
		return
	end
	
	local szTip = ""
    szTip = szTip.."<Text>text="..EncodeComponentsString(npc.szName.."\n").." font=80".." r=255 g=255 b=255 </text>"
