function RaidGrid_Base.GetEventTimerSet(handleRecord)
	if not handleRecord then
		return
	end
	local Recall = function(szText)
		handleRecord.tRecord.szTimerSet = nil
		handleRecord.tRecord.tTimerSet = nil
		if not szText or szText == "" then
			return
		end
		szText=string.gsub(szText," ","")--消灭空格
		szText=string.gsub(szText,"，",",") --消灭全角逗号
		szText=string.gsub(szText,",,",",")  --消灭2个逗号
		szText=string.gsub(szText,"；",";")  --消灭全角分号
		szText=string.gsub(szText,";;",";")  --消灭2个分号
		if not szText or szText == "" or szText == "," or szText == ";" then
			return
		end

		local szString = szText
		local k=1
		local name=""
		local list={}
		while (k and szString~="" and szString~=";") do
			k=string.find(szString,";")
			if not k then
				name=szString
			else
				name=string.sub(szString,1,k-1)
				szString=string.sub(szString,k+1)
			end
			local j=string.find(name,",")
			if j then
				local szname1 = string.sub(name,1,j-1)
				local szname2 = string.sub(name,j+1)
				local n1 = tonumber(szname1)
				if n1 and szname2 then
					table.insert(list,{nTime = n1,szTimerName = szname2})
				end
			end
		end
		
		if #list > 0 then
			table.sort(list,function(a,b) return (a.nTime<b.nTime) end)
			handleRecord.tRecord.szTimerSet = szText
			handleRecord.tRecord.tTimerSet = list
		end
		RaidGrid_EventScrutiny.UpdateRecordList(RaidGrid_EventScrutiny.szListIndex)
	end
	GetUserInput(handleRecord.tRecord.szName.."(Thiết lập phân đoạn thời gian, VD: 25,Lôi Trảo;40,Bắn Quét;)", Recall, nil, function() end, nil, handleRecord.tRecord.szTimerSet or "", 999)
end

