function RaidGrid_Base.GetRGBuffColor(handleRecord)
	if not handleRecord then
		return
	end
	local Recall = function(szText)
		if not szText or szText == "" then
			return
		end
		szText = szText:gsub("%s", "")
		szText = szText:gsub("，", ",")
		szText = szText:gsub("；", ",")
		
		local nRed, nGreen, nBlue
		if szText:match("Đỏ") then
			nRed, nGreen, nBlue = 255, 0, 0
		elseif szText:match("Lục") then
			nRed, nGreen, nBlue = 0, 255, 0
		elseif szText:match("Lam") then
			nRed, nGreen, nBlue = 0, 0, 255
		elseif szText:match("Vàng") then
			nRed, nGreen, nBlue = 255, 255, 0
		elseif szText:match("Tím") then
			nRed, nGreen, nBlue = 255, 0, 255
		elseif szText:match("Trắng") then
			nRed, nGreen, nBlue = 255, 255, 255
		else
			nRed = szText:match("^(%d+),")
			if not nRed then return end
			nGreen = szText:match(",(%d+),")
			if not nGreen then return end
			nBlue = szText:match(",(%d+),?$")
			if not nBlue then return end
		end
		
		handleRecord.tRecord.tRGBuffColor = {tonumber(nRed), tonumber(nGreen), tonumber(nBlue)}
		RaidGrid_EventScrutiny.UpdateRecordList(RaidGrid_EventScrutiny.szListIndex)
	end
	handleRecord.tRecord.tRGBuffColor = handleRecord.tRecord.tRGBuffColor or {}
	local szDef = (handleRecord.tRecord.tRGBuffColor[1] or 0) .. "," .. (handleRecord.tRecord.tRGBuffColor[2] or 0) .. "," .. (handleRecord.tRecord.tRGBuffColor[3] or 0)
