end

function RaidGrid_Base.Time2String(nTime)
	nTime = nTime or 0
	local nMinPart = math.min(math.floor(nTime / 60), 59)
	local nSecPart = math.floor(nTime % 60)
	if (nTime / 60) > 59 then
		nSecPart = 59
	end
	
	local szTime = ""
	if nMinPart == 0 and nSecPart == 0 then
		szTime = ""
	elseif nMinPart == 0 then
		szTime = nSecPart .. [["]]
	else
		szTime = nMinPart .. "'" .. nSecPart .. [["]]
	end
	return szTime
end

function RaidGrid_Base.GetLogicTime()
	local fLogicTime = GetLogicFrameCount() / GLOBAL.GAME_FPS
	return fLogicTime
end

function RaidGrid_Base.IsOutOfEventTime(tRecord, nRemoveDelayTime)
	nRemoveDelayTime = nRemoveDelayTime or 0
	if not tRecord.fEventTimeStart or not tRecord.fEventTimeEnd then
		tRecord.fEventTimeStart = nil
		tRecord.fEventTimeEnd = nil
		return true
	end

	local fCurrentLogicTime = GetLogicFrameCount() / GLOBAL.GAME_FPS
	if fCurrentLogicTime < tRecord.fEventTimeStart or fCurrentLogicTime > tRecord.fEventTimeEnd + nRemoveDelayTime then
		return true
	end
	
	return false
end

function RaidGrid_Base.LowAverage(tNumbers)
	local nAvg = 0
	local nMax = 0
	local nMax2 = 0
	local nMax3 = 0
	if tNumbers then
		for j = 1, #tNumbers do
			if type(tNumbers[j]) == "number" then
				nAvg = nAvg + tNumbers[j]
				if tNumbers[j] > nMax then
					nMax3 = nMax2
					nMax2 = nMax
					nMax = tNumbers[j]
				elseif tNumbers[j] > nMax2 then
					nMax3 = nMax2
					nMax2 = tNumbers[j]
				elseif tNumbers[j] > nMax3 then
					nMax3 = tNumbers[j]
				end
			end
		end
		if #tNumbers >= 4 then
			nAvg = (nAvg - nMax - nMax2 - nMax3) / (#tNumbers - 3)
		elseif #tNumbers >= 1 then
			nAvg = nAvg / #tNumbers
		end
	end
	return nAvg
end

function RaidGrid_Base.IsInDungeon()
	local player = GetClientPlayer()
	if not player then
		return
	end
	local scene = player.GetScene()
	if not scene then
		return
	end
	if scene.nType ~= 1 and scene.nType ~= 4 then
		return
	end
	return true
end

function RaidGrid_Base.GetCurrentMapName()
	local player = GetClientPlayer()
	if not player then
		return "Không xác định"
	end
	local scene = player.GetScene()
	if not scene then
		return "Không xác định"
	end
	local dwSceneID = scene.dwMapID
	if not dwSceneID then
		return "Không xác định"
	end
	local szMapName = Table_GetMapName(dwSceneID)
	return szMapName or "Không xác định"
end

function RaidGrid_Base.GetNameAndTypeFromId(dwID)
	local playerMember
	local szType = "Không biết"
	if dwID <= 0 then
		return "Không xác định", szType
	end
	if IsPlayer(dwID) then
		playerMember = GetPlayer(dwID)
		szType = "Player"
	else
		playerMember = GetNpc(dwID)
		szType = "Npc"
	end
	if not playerMember then
		return "Không xác định", szType
	end
	local szName = playerMember.szName
	return szName or "Không xác định", szType
end

----列表/字符串转换----
function RaidGrid_Base.getList(szString)--将字符串转换成列表
	szString=string.gsub(szString," ","")--消灭空格
	szString=string.gsub(szString,"，",",") --消灭全角逗号
	szString=string.gsub(szString,",,",",")  --消灭2个逗号
	local k=1
	local name=""
	local list={}
	while (k and szString~="" and szString~=",") do
		k=string.find(szString,",")
		if not k then
			name=szString
		else
			name=string.sub(szString,1,k-1)
			szString=string.sub(szString,k+1)
		end
		table.insert(list,name)
	end
	return list
end

function RaidGrid_Base.AddOneNameToTable(handleTable, szType)
	if not handleTable then
		return
	end
	local Recall = function(szText)
		if not szText or szText == "" or szText == "," or szText == "，" then
			return
		end
		handleTable.szToAddNameList = szText .. "," .. handleTable.szToAddNameList
		handleTable[szText] = true
		RaidGrid_Base.DoAddByNameTable(szType)
		if RaidGrid_EventCache.szListIndex == szType then
			RaidGrid_EventCache.UpdateRecordList(RaidGrid_EventCache.szListIndex)
		end
	end
	GetUserInput("Nhập tên mà bạn muốn thêm (".. szType ..")", Recall, nil, function() end, nil, "", 31)
end

function RaidGrid_Base.SetAddByNameTable(handleTable, szType)
	if not handleTable then
		return
	end
	local Recall = function(szText)
		for k, v in pairs(handleTable) do
			handleTable[k] = nil
		end
		handleTable.szToAddNameList = ""
		if not szText or szText == "" or szText == "," or szText == "，" then
			return
		end
		handleTable.szToAddNameList = szText
		local tAddNameTable = RaidGrid_Base.getList(handleTable.szToAddNameList)
		for k, szName in pairs(tAddNameTable) do
			handleTable[szName] = true
		end
		RaidGrid_Base.DoAddByNameTable(szType)
		if RaidGrid_EventCache.szListIndex == szType then
			RaidGrid_EventCache.UpdateRecordList(RaidGrid_EventCache.szListIndex)
		end
	end
	GetUserInput("Thiết lập thêm tên chuỗi, cách nhau bằng dấu phẩy (".. szType ..")", Recall, nil, function() end, nil, handleTable.szToAddNameList or "", 310)
end

function RaidGrid_Base.DoAddByNameTable(szType)
	for k, tInfo in pairs(RaidGrid_EventCache.tRecords[szType]) do
		if tInfo.szName and RaidGrid_EventCache.tAddByName[szType][tInfo.szName] then
			RaidGrid_EventScrutiny.AddRecordToList(tInfo, tInfo.szType)
		end
	end
end

