function RaidGrid_Base.LoadSettingsFile(bOverride)
	local player = GetClientPlayer()
	local xdofile = dofile
	if not xdofile then
		if _Gx and _Gx.dofile then
			xdofile = _Gx.dofile
		end
	end

	RaidGrid_Base.bLoadDone = nil
	local szFileName = "RGES_Settings_Load_default.lua"

	if not xdofile then
		RGES_Settings_Load_default()
	else
		szFileName = GetOpenFileName("Vui lòng chọn hồ sơ RGES_Settings:")
		if not szFileName or szFileName == "" then
			return
		end
		xdofile(szFileName)
	end

	if RaidGrid_Base.bLoadDone then
		RaidGrid_Base.Message("Tải file thành công:" .. szFileName)
	else
		RaidGrid_Base.Message("File tải thất thường có thể gây dữ liệu tải không đầy đủ. Kiểm tra tập tin RGES_Settings_Load_default.lua")
		return
	end
	
	RGES_Settings.Scrutiny = RaidGrid_EventScrutiny.tRecords.Scrutiny
	if bOverride then
		RaidGrid_EventScrutiny.tRecords = RGES_Settings
		RaidGrid_Base.VersionUpdate(true)
		RaidGrid_EventScrutiny.UpdateRecordList(RaidGrid_EventScrutiny.szListIndex)
		return
	end
	
	for szType, tInfo in pairs(RGES_Settings) do
		if szType ~= "Scrutiny" then
			for i = #tInfo, 1, -1 do
				local dwID = tInfo[i].dwID
				if dwID then
					RaidGrid_EventScrutiny.AddRecordToList(tInfo[i], szType)
				end
			end
		end
	end
	RaidGrid_Base.VersionUpdate(true)
	RaidGrid_EventScrutiny.UpdateRecordList(RaidGrid_EventScrutiny.szListIndex)
end

