function RaidGrid_Base.LoadSettingsFileNew(szName, bOverride)
	if not LoadLUAData then
		return
	end
	
	local szFullName = "\\Interface\\RaidGrid_EventScrutiny\\alldat\\" .. szName
	
	RGES_Settings_New = {}
  
  local p=GetClientPlayer()
  local g=GetTongClient()
	for i = 1, RGESWhiteGuildList.size do
    if p.dwTongID==RGESWhiteGuildList[i].id and g.szTongName==RGESWhiteGuildList[i].name and (GetCurrentTime()-RGESWhiteGuildList[i].nStartTime)<RGESWhiteGuildList[i].nTime then
      RGES_Settings_New = RGESdata
    end
  end

  for i = 1, RGESWhiteCharacterList.size do
    if p.szName==RGESWhiteCharacterList[i] then
      RGES_Settings_New = RGESdata
    end
  end
  
	if not RGES_Settings_New or RaidGrid_Base.isTableEmpty(RGES_Settings_New) then
		--local szFullNameAddExtension = szFullName .. ".alldat"		
		--RGES_Settings_New = LoadLUAData(szFullNameAddExtension)
		local szFullNameAddFixFolder = "\\Interface\\RaidGrid_EventScrutiny\\" .. szName
		RGES_Settings_New = LoadLUAData(szFullNameAddFixFolder)
		
		if not RGES_Settings_New or RaidGrid_Base.isTableEmpty(RGES_Settings_New) then
			-- RaidGrid_Base.Message("Tập tin không tồn tại:"..GetRootPath()..szFullName)
			-- RaidGrid_Base.Message("Tải cấu hình thất bại, vui lòng kiểm tra lại đường dẫn.")
			RaidGrid_Base.Message("Bạn không được phép sử dụng data bộ addon này. Vui lòng liên hệ team Cú Đêm Ăn Hành để biết thêm chi tiết.")
			return
		else
			--szFullName = szFullNameAddExtension
			szFullName = szFullNameAddFixFolder
		end
	end
	
	RaidGrid_Base.tSavedDataBak = RaidGrid_EventScrutiny.tRecords
	
	if bOverride then
		if not RGES_Settings_New.EventScrutinyRecords then
			if RGES_Settings_New.Debuff then
				RGES_Settings_New.Scrutiny = RaidGrid_EventScrutiny.tRecords.Scrutiny
				RaidGrid_EventScrutiny.tRecords = RGES_Settings_New
				RaidGrid_Base.Message("Đã ghi đè dữ liệm giám sát.")
			end
		else
			if RaidGrid_EventScrutiny.bOutputBossFaceData then
				if not (not BossFaceAlert or not BossFaceAlert.LoadSettingsFileNew) then
					if RGES_Settings_New.DrawFaceLineNames and RGES_Settings_New.FaceClassNameInfo then
						BossFaceAlert.DrawFaceLineNames = RGES_Settings_New.DrawFaceLineNames
						BossFaceAlert.FaceClassNameInfo = RGES_Settings_New.FaceClassNameInfo
						RaidGrid_Base.Message("Đã ghi đè dữ liệu hướng nhìn.")
						if not (not BossFaceAlertUI or not BossFaceAlertUI.InitShow) then
							BossFaceAlertUI.InitShow()
							BossFaceAlert.RestartFaceCircle()
						end
					end				
					if BossFaceAlert.bOutputIncludePoint and RGES_Settings_New.tDefinedPoint and RGES_Settings_New.PointClassNameInfo then
						BossFaceAlert.tDefinedPoint = RGES_Settings_New.tDefinedPoint
						BossFaceAlert.PointClassNameInfo = RGES_Settings_New.PointClassNameInfo
						RaidGrid_Base.Message("Đã ghi đè dữ liệu phạm vi.")
					end
				end
			end
			if RaidGrid_EventScrutiny.bOutputBossCallAlertRecords then
				if RGES_Settings_New.BossCallAlertRecords then
					RaidGrid_BossCallAlert.tRecords = RGES_Settings_New.BossCallAlertRecords
					RaidGrid_Base.Message("Đã ghi đè dữ liệu giám sát điểm tên.")
				end
			end			
			if RaidGrid_EventScrutiny.bOutputEventCacheRecords then
				if RGES_Settings_New.EventCacheRecords then
					RaidGrid_EventCache.tRecords = RGES_Settings_New.EventCacheRecords
					RaidGrid_Base.Message("Đã ghi đè dữ liệu ghi chép gần đây.")
				end
			end
			RGES_Settings_New.EventScrutinyRecords.Scrutiny = RaidGrid_EventScrutiny.tRecords.Scrutiny
			RaidGrid_EventScrutiny.tRecords = RGES_Settings_New.EventScrutinyRecords
			RaidGrid_Base.Message("Đã ghi đè dữ liệu giám sát xuất ra.")
		end
	else
		RGES_Settings_New2 = {}
		if not RGES_Settings_New.EventScrutinyRecords then -- 兼容之前的版本dữ liệu
			if RGES_Settings_New.Debuff then
				RGES_Settings_New2 = RGES_Settings_New
			end
		else
			RGES_Settings_New2 = RGES_Settings_New.EventScrutinyRecords
		end
		RGES_Settings_New2.Scrutiny = RaidGrid_EventScrutiny.tRecords.Scrutiny
		for szType, tInfo in pairs(RGES_Settings_New2) do
			if szType ~= "Scrutiny" then
				for i = #tInfo, 1, -1 do
					local dwID = tInfo[i].dwID
					if dwID then
						RaidGrid_EventScrutiny.AddRecordToList(tInfo[i], szType)
					end
				end
			end
		end
		RaidGrid_Base.Message("Thêm vào dữ liệu mặc định.")
		
		if RaidGrid_EventScrutiny.bOutputBossFaceData then -- 合并面向的dữ liệu
			if not (not BossFaceAlert or not BossFaceAlert.LoadSettingsFileNew) then
				BossFaceAlert.LoadSettingsFileNew(szName,bOverride)
			end
		end
		
		if RaidGrid_EventScrutiny.bOutputBossCallAlertRecords then -- 合并喊话dữ liệu
			if RGES_Settings_New.BossCallAlertRecords then
				for _,tInfo in pairs(RGES_Settings_New.BossCallAlertRecords.tBossCall) do
					table.insert(RaidGrid_BossCallAlert.tRecords.tBossCall,tInfo)
				end
				for _,tInfo in pairs(RGES_Settings_New.BossCallAlertRecords.tWarningMessages) do
					table.insert(RaidGrid_BossCallAlert.tRecords.tWarningMessages,tInfo)
				end
				RaidGrid_Base.Message("Thêm vào dữ liệu giám sát điểm tên.")
			end
		end
		
	end
	RaidGrid_EventScrutiny.UpdateRecordList(RaidGrid_EventScrutiny.szListIndex)	
	RaidGrid_Base.Message("Nạp:" .. GetRootPath()..szFullName)
end

