function RaidGrid_EventScrutiny.OnFrameCreate()
	this:RegisterEvent("BUFF_UPDATE")
	this:RegisterEvent("NPC_ENTER_SCENE")
	this:RegisterEvent("NPC_LEAVE_SCENE")
	this:RegisterEvent("UI_SCALED")
	this:RegisterEvent("DO_SKILL_CAST")
	this:RegisterEvent("SYS_MSG")
	this:RegisterEvent("FIGHT_HINT")
	this:RegisterEvent("ON_BG_CHANNEL_MSG")
	if not RaidGrid_EventScrutiny.tRecords.Buff.Hash2 then RaidGrid_EventScrutiny.tRecords.Buff.Hash2 = {} end
	if not RaidGrid_EventScrutiny.tRecords.Debuff.Hash2 then RaidGrid_EventScrutiny.tRecords.Debuff.Hash2 = {} end
	if not RaidGrid_EventScrutiny.tRecords.Npc.Hash2 then RaidGrid_EventScrutiny.tRecords.Npc.Hash2 = {} end
