	if not RaidGrid_EventScrutiny.tRecords.Scrutiny.Hash2 then RaidGrid_EventScrutiny.tRecords.Scrutiny.Hash2 = {} end
end

function RaidGrid_EventScrutiny.OnFrameBreathe()
	RaidGrid_EventScrutiny.nSetper = RaidGrid_EventScrutiny.nSetper + 1
	
	local player = GetClientPlayer()
	if not player then
		return
	end

	local nX, nY = RaidGrid_EventScrutiny.frameSelf:GetRelPos()
	if RaidGrid_EventScrutiny.tLastLoc.nX ~= nX and RaidGrid_EventScrutiny.tLastLoc.nY ~= nY then
		RaidGrid_Base.SetPanelPos(nX, nY)
	end 

	if RaidGrid_EventScrutiny.nSetper % 8 == 0 then
		RaidGrid_EventScrutiny.CheckNpcFightState()
		RaidGrid_EventScrutiny.CheckLifeAndAlarm()
		RaidGrid_EventScrutiny.CheckTeamLifeAndMana()
	end
	if RaidGrid_EventScrutiny.nSetper % 4 == 0 then
		RaidGrid_EventScrutiny.RefreshEventHandle()
	end
	
	RaidGrid_EventScrutiny.CheckFightState()
	RaidGrid_BossCallAlert.GetWarningMessage()
	local nTime = GetTime()
	for k = #RE.tDelayCall, 1, -1 do
		local v = RE.tDelayCall[k]
		if v.nTime <= nTime then
			local res, err = pcall(v.fnAction)
			if not res then
				Output("DelayCall#" .. k .." ERROR: " .. err)
			end
			table.remove(RE.tDelayCall, k)
		end
	end
end

function RaidGrid_EventScrutiny.OnEvent(szEvent)
	local player = GetClientPlayer()
	if not player then
		return
	end
	if szEvent == "BUFF_UPDATE" then
		--if player.IsPlayerInMyParty(arg0) or player.dwID == arg0 then
		--if player.dwID == arg0 and RaidGrid_EventScrutiny.bScrutinySelfBuff then
			RaidGrid_EventScrutiny.OnUpdateBuffData(arg0, arg1, arg2, arg4, arg5, arg6, arg8, arg9)
		--end
	elseif szEvent == "NPC_ENTER_SCENE" then
		local npc = GetNpc(arg0)
		if npc then
			local dwTemplateID = npc.dwTemplateID
			RaidGrid_EventScrutiny.OnNpcCreationEvent(dwTemplateID, npc)
		end
	elseif szEvent == "NPC_LEAVE_SCENE" then
		local npc = GetNpc(arg0)
		if npc then
			local dwTemplateID = npc.dwTemplateID
			RaidGrid_EventScrutiny.OnNpcLeaveEvent(dwTemplateID, npc)
		end
	elseif szEvent == "UI_SCALED" then
		RaidGrid_SelfBuffAlert.RescaleBG()
	elseif szEvent == "DO_SKILL_CAST" then
		RaidGrid_EventScrutiny.OnSkillCasting("DO_SKILL_CAST", arg0, arg1, arg2)--arg3 == Target.szName
	elseif szEvent == "SYS_MSG" then
		if arg0 == "UI_OME_SKILL_CAST_LOG" then
			RaidGrid_EventScrutiny.OnSkillCasting(arg0, arg1, arg2, arg3)
		--elseif arg0 == "UI_OME_SKILL_CAST_RESPOND_LOG" then
			--GlobalEventHandler.OnSkillCastRespond(arg1, arg2, arg3, arg4);
			--RaidGrid_EventScrutiny.OnSkillCasting(arg0, arg1, arg2, arg3)
		elseif RaidGrid_EventScrutiny.bCastingScrutinyAllEnable then
			if arg0 == "UI_OME_SKILL_EFFECT_LOG" and arg4 == SKILL_EFFECT_TYPE.SKILL then
				--GlobalEventHandler.OnSkillEffectLog(arg1, arg2, arg3, arg4, arg5, arg6, arg7, arg8, arg9);
				RaidGrid_EventScrutiny.OnSkillCasting(arg0, arg1, arg5, arg6, arg2)
			elseif arg3 == SKILL_EFFECT_TYPE.SKILL and (arg0 == "UI_OME_SKILL_BLOCK_LOG" or arg0 == "UI_OME_SKILL_SHIELD_LOG" or arg0 == "UI_OME_SKILL_MISS_LOG" or arg0 == "UI_OME_SKILL_DODGE_LOG" or arg0 == "UI_OME_SKILL_HIT_LOG") then
				--GlobalEventHandler.OnSkillBlockLog(arg1, arg2, arg3, arg4, arg5, arg6)
				--RaidGrid_EventScrutiny.OnSkillCasting(arg0, arg1, arg4, arg5, arg2)
			--elseif arg0 == "UI_OME_SKILL_SHIELD_LOG" then
				--GlobalEventHandler.OnSkillShieldLog(arg1, arg2, arg3, arg4, arg5)
				--RaidGrid_EventScrutiny.OnSkillCasting(arg0, arg1, arg4, arg5, arg2)
			--elseif arg0 == "UI_OME_SKILL_MISS_LOG" then
				--GlobalEventHandler.OnSkillMissLog(arg1, arg2, arg3, arg4, arg5)
				--RaidGrid_EventScrutiny.OnSkillCasting(arg0, arg1, arg4, arg5, arg2)
			--elseif arg0 == "UI_OME_SKILL_HIT_LOG" then
				--GlobalEventHandler.OnSkillHitLog(arg1, arg2, arg3, arg4, arg5);
				--RaidGrid_EventScrutiny.OnSkillCasting(arg0, arg1, arg4, arg5, arg2)
			--elseif arg0 == "UI_OME_SKILL_DODGE_LOG" then
				--GlobalEventHandler.OnSkillDodgeLog(arg1, arg2, arg3, arg4, arg5);
				RaidGrid_EventScrutiny.OnSkillCasting(arg0, arg1, arg4, arg5, arg2)
			end
		end
	elseif szEvent == "FIGHT_HINT" then
		RaidGrid_EventScrutiny.bSelfInFightState = arg0
	elseif szEvent == "ON_BG_CHANNEL_MSG" then
		local t = player.GetTalkData()
		if t and t[2] then
			if t[2].text == "ShareEventScrutinyVersion" and t[4] and player.szName == t[4].text then
				RaidGrid_Base.Message(t[3].text)
			end
			if RaidGrid_EventScrutiny.bBGCHANNELMSG then
				if t[2].text == "CheckEventScrutinyVersion" and player.szName ~= arg3 and t[3] then
					--RaidGrid_Base.Message("队友[" .. tostring(arg3) .. "]正在获取Bạn的版本信息.")
					RaidGrid_Base.ShareTeamVersion(t[3].text)
				end
				if t[2].text == "EventScrutinyTeamHelpReset" and player.szName ~= arg3 and t[3] and t[3].text == "tRecordsReset" and t[4] then
					if t[4].text == "ALL" or t[4].text == player.szName then
						RaidGrid_Base.Message("Đồng đội [" .. tostring(arg3) .. "] đang giúp bạn trả về thiết lập mặc định.")
						RaidGrid_Base.tRecordsClearSureNew()
					end
				end
			end
			-- 开始发送
			if player.IsInParty() then
				if t[2].text == "SendDataToTeamStart" and t[3] and player.szName ~= t[3].text and not RaidGrid_EventScrutiny.TempData then
					local team = GetClientTeam()
					local _GetName = team.GetClientTeamMemberName
					local szLeader = _GetName(team.GetAuthorityInfo(TEAM_AUTHORITY_TYPE.LEADER))
					if t[3].text ~= "ĐườngKiệt" then
						if szLeader ~= t[3].text and (not t[5] or t[5].text ~= "Reset") then
							return RaidGrid_Base.Message(t[3].text.." muốn chia sẻ dữ liệu với bạn nhưng không phải đội trưởng, tự động từ chối.")
						end
					end
					if t[4] and t[4].text ~= player.szName and t[4].text ~= "ALL" then
						return
					end
					RaidGrid_Base.Message("Đội trưởng "..t[3].text.." đang chia sẻ dữ liệu.")
					RaidGrid_EventScrutiny.SendDataToTeamStart = true
					RaidGrid_EventScrutiny.TempData = {}
				end
			
			-- 接收dữ liệu
			
				if t[2].text == "SendDataToTeam" and t[3] and t[4] and RaidGrid_EventScrutiny.SendDataToTeamStart then				
					RaidGrid_Base.Message("Đang nhận dữ liệu "..t[4].text)
					t[4].text = RaidGrid_EventScrutiny.FixKeyTempData(t[4].text)
					if t[3].text == "table" then
						if not t[5] then
							RaidGrid_EventScrutiny.TempData[t[4].text] = {}
						elseif not t[6] then
							t[5].text = RaidGrid_EventScrutiny.FixKeyTempData(t[5].text)
							RaidGrid_EventScrutiny.TempData[t[4].text][t[5].text] = {}
						end
					else
						if t[6] and not t[7] then
							t[5].text = RaidGrid_EventScrutiny.FixKeyTempData(t[5].text)
							RaidGrid_EventScrutiny.TempData[t[4].text][t[5].text] = RaidGrid_EventScrutiny.InsertTempData(t[3].text,t[6].text)
						elseif t[7] then
							t[5].text = RaidGrid_EventScrutiny.FixKeyTempData(t[5].text)
							t[6].text = RaidGrid_EventScrutiny.FixKeyTempData(t[6].text)
							RaidGrid_EventScrutiny.TempData[t[4].text][t[5].text][t[6].text] = RaidGrid_EventScrutiny.InsertTempData(t[3].text,t[7].text)
						else
							RaidGrid_EventScrutiny.TempData[t[4].text] = RaidGrid_EventScrutiny.InsertTempData(t[3].text,t[5].text)
						end
					end

				end
				
				-- 结束发送
				if t[2].text == "SendDataToTeamEnd" and t[3] and player.szName ~= t[3].text and RaidGrid_EventScrutiny.SendDataToTeamStart then
					RaidGrid_Base.Message("Đã nhận dữ liệu, vui lòng xác nhận.")
					RaidGrid_EventScrutiny.SendDataToTeamStart = false
					
					local szText = ""
					szText = szText.."<Text>text="..EncodeComponentsString(" Chia sẻ dữ liệu cho toàn đội\n").." font=207 r=255 g=255 b=255</text>"
					szText = szText.."<Text>text="..EncodeComponentsString(" Đồng đội: "..t[3].text.." đã gửi dữ liệu, bạn có muốn thêm vào không？\n").." font=16</text>"
					local msg = 
					{
						szMessage = szText,
						bRichText = true,
						fnCancelAction = function()
							RE.Talk(t[3].text,"Bỏ qua dữ liệu chia sẻ")
							RaidGrid_EventScrutiny.TempData = nil
						end,
						szName = "RaidGrid_Base_SendDataToTeam",
						{szOption = "Thêm", fnAction = function()
								RE.Talk(t[3].text,"Đã thêm vào dữ liệu")
								RaidGrid_EventScrutiny.Macro(RaidGrid_EventScrutiny.TempData,t[4].text)
								RaidGrid_EventScrutiny.TempData = nil
							end
						},
						{szOption = "Bỏ qua", fnAction = function()
								RE.Talk(t[3].text,"Bỏ qua dữ liệu chia sẻ")
								RaidGrid_EventScrutiny.TempData = nil
							end
						},
					}
					MessageBox(msg)

				end
			end
		end
	end
end

function RaidGrid_EventScrutiny.InsertTempData(szType,value)
	if szType == "boolean" then
		if value == "true" then
			return true
		else
			return false
		end
	elseif szType == "number" then
		return tonumber(value)
	else
		return value
	end
end
function RaidGrid_EventScrutiny.FixKeyTempData(Key)
	if string.find(Key,"\*") then
		RaidGrid_Base.MessageWarning("Lỗi:"..Key)
		local data = {}
		data["szLinkNp**ame"] = "szLinkNpcName"
		data["bEne**"] = "bEnemy"
		data["nP**o**tyLevel"] = "nPriorityLevel"
		data["szDesc**ption"] = "szDescription"
		
		data["**imerHeadEnable"] = "bTimerHeadEnable"
		data["bShowNP**elfName"] = "bShowNPCSelfName"
		data["bShowDesc**ptionName"] = "bShowDescriptionName"
		data["bI**uffDispel"] = "bIsBuffDispel"
		if data[Key] then
			Key = data[Key]
			RaidGrid_Base.Message("Sửa chữa:"..Key)
		else
			RaidGrid_Base.MessageWarning("Sửa chữa thất bại, không có dữ liệu, vui lòng gửi phản hồi cho tác giả!")
		end
		
	end
	Key = tonumber(Key) or Key
	return Key
end

function RaidGrid_EventScrutiny._SetItemUI(szName,ojb,boolean)
	local _U = tRaidGrid_EventScrutinyTextUI	
	if _U[szName] then
		if not boolean then
			ojb:Lookup(_U[szName][1]):SetFontColor(_U[szName][2][1],_U[szName][2][2],_U[szName][2][3])
		else
			local r,g,b = _U[szName][3][1],_U[szName][3][2],_U[szName][3][3]
			if szName == "Image_ASBox" then 
				if ojb.tRecord.tRGAlertColor then
					r,g,b,_ = unpack(ojb.tRecord.tRGAlertColor)
				end
			end
			ojb:Lookup(_U[szName][1]):SetFontColor(r,g,b)
		end
	end
end

