			{szOption = "Đỏ █", bCheck = false, bChecked = false, r = 255, g = 0, b = 0, fnAction = function() tRecord.tRGAlertColor = {255, 0, 0, 3}; RaidGrid_EventScrutiny._SetItemUI(szName,ojb,true) end},
			{szOption = "Lục █", bCheck = false, bChecked = false, r = 0, g = 255, b = 0, fnAction = function() tRecord.tRGAlertColor = {0, 255, 0, 1}; RaidGrid_EventScrutiny._SetItemUI(szName,ojb,true) end},
			{szOption = "Lam █", bCheck = false, bChecked = false, r = 0, g = 0, b = 255, fnAction = function() tRecord.tRGAlertColor = {0, 0, 255, 0}; RaidGrid_EventScrutiny._SetItemUI(szName,ojb,true) end},
			{szOption = "Vàng █", bCheck = false, bChecked = false, r = 255, g = 255, b = 0, fnAction = function() tRecord.tRGAlertColor = {255, 255, 0, 5}; RaidGrid_EventScrutiny._SetItemUI(szName,ojb,true) end},
			{szOption = "Tím █", bCheck = false, bChecked = false, r = 255, g = 0, b = 255, fnAction = function() tRecord.tRGAlertColor = {255, 0, 255, 2}; RaidGrid_EventScrutiny._SetItemUI(szName,ojb,true) end},
			{szOption = "Trắng █", bCheck = false, bChecked = false, r = 255, g = 255, b = 255, fnAction = function() tRecord.tRGAlertColor = {255, 255, 255, 4}; RaidGrid_EventScrutiny._SetItemUI(szName,ojb,true) end},
			{szOption = "Đóng", bCheck = false, bChecked = false, r = 210, g = 210, b = 210, fnAction = function() tRecord.tRGAlertColor = nil; RaidGrid_EventScrutiny._SetItemUI(szName,ojb,false) end},
