		if RaidGrid_EventScrutiny.bFunctionPcallErrOutput and not status and err then
			Output(err, "RaidGrid_EventScrutiny.CheckTeamLifeAndMana")
		end
	else
		RaidGrid_EventScrutiny.CheckTeamLifeAndManaOrg()
	end
end

function RaidGrid_EventScrutiny.CheckTeamLifeAndManaOrg()
	if not RaidGrid_EventScrutiny.bTeamLifeAndManaAlarmEnable then
		return
	end
	if RaidGrid_EventScrutiny.nLifeHeadPer <= 0 and RaidGrid_EventScrutiny.nManaHeadPer <= 0 then
		return
	end
	
	local player = GetClientPlayer()
	if not player then
		return
	end
	
	if not RaidGrid_EventScrutiny.bSelfInFightState then
		return
	end
	
	local hTeam = GetClientTeam()
	if not hTeam then
		return
	end
	local nGroupNum = hTeam.nGroupNum
	local dwToSelectID = 0
	local nDistanceTemp = 90000000
	local nCurrentLifeTemp = 90000000
	local nCurrentLifePerTemp = 90000000
	local dwMyTeamToSelectID = 0
	for i = 0, nGroupNum - 1 do
		local tGroupInfo = hTeam.GetGroupInfo(i)
		local dwToSelectIDOfOneTeam = 0
		local nCurrentLifeOfOneTeam = 90000000
		local bMyTeam = false
		if tGroupInfo and tGroupInfo.MemberList then
			for _,dwID in pairs(tGroupInfo.MemberList) do
				local hPlayer2 = hTeam.GetMemberInfo(dwID)
				local playerMember = GetPlayer(dwID)
				if player.dwID == dwID then
					bMyTeam = true
				end
				if hPlayer2 and not hPlayer2.bDeathFlag and hPlayer2.bIsOnLine and playerMember then
					local lifeper = hPlayer2.nCurrentLife / hPlayer2.nMaxLife
					local manaper = hPlayer2.nCurrentMana / hPlayer2.nMaxMana
					if RaidGrid_EventScrutiny.nLifeHeadPer >= lifeper then
						if RaidGrid_EventScrutiny.bTeamLifeAutoSelectEnable then
							local nDistance = GetCharacterDistance(player.dwID, dwID)
							if not nDistance or nDistance < 0 then
								nDistance = 10000
							end
							if not RaidGrid_EventScrutiny.nTeamLifeSelectDisLimit or (RaidGrid_EventScrutiny.nTeamLifeSelectDisLimit * 64) >= nDistance then
								if RaidGrid_EventScrutiny.bTeamLifeAutoSelectMod == 1 then
									if nDistance < nDistanceTemp then
										dwToSelectID = dwID
										nDistanceTemp = nDistance
									end
								elseif RaidGrid_EventScrutiny.bTeamLifeAutoSelectMod == 2 or RaidGrid_EventScrutiny.bTeamLifeAutoSelectMod == 5 then
									if hPlayer2.nCurrentLife < nCurrentLifeTemp then
										dwToSelectID = dwID
										nCurrentLifeTemp = hPlayer2.nCurrentLife
									end
								elseif RaidGrid_EventScrutiny.bTeamLifeAutoSelectMod == 3 then
									if lifeper < nCurrentLifePerTemp then
										dwToSelectID = dwID
										nCurrentLifePerTemp = lifeper
									end
								elseif RaidGrid_EventScrutiny.bTeamLifeAutoSelectMod == 4 then
									dwToSelectID = dwID
								elseif dwToSelectID == 0 then
									dwToSelectID = dwID
								end
								if hPlayer2.nCurrentLife < nCurrentLifeOfOneTeam then
									dwToSelectIDOfOneTeam = dwID
									nCurrentLifeOfOneTeam = hPlayer2.nCurrentLife
								end
								if player.dwID == dwID then
									dwMyTeamToSelectID = dwID
								end
							end
							--RaidGrid_Base.SetTarget(dwID)
						end
						if RaidGrid_EventScrutiny.bScreenHeadMonitor then
							RaidGrid_ScreenHead.addAlarmFrame(dwID, RaidGrid_EventScrutiny.tLifeHeadRecord, true)
						end
					elseif RaidGrid_EventScrutiny.bScreenHeadMonitor and playerMember and playerMember.dwForceID < 7 and RaidGrid_EventScrutiny.nManaHeadPer >= manaper then
						RaidGrid_ScreenHead.addAlarmFrame(dwID, RaidGrid_EventScrutiny.tManaHeadRecord, true)
					end
				end
			end
		end
		if dwMyTeamToSelectID == 0 and bMyTeam and RaidGrid_EventScrutiny.bTeamLifeAutoSelectMod == 5 then
			dwMyTeamToSelectID = dwToSelectIDOfOneTeam
		end
	end
	if dwMyTeamToSelectID > 0 then
		dwToSelectID = dwMyTeamToSelectID
	end
	if dwToSelectID > 0 then
		RaidGrid_Base.SetTarget(dwToSelectID)
	end
end

function RaidGrid_EventScrutiny.CheckFightState()
	if RaidGrid_EventScrutiny.bFunctionPcallRunMode then
		local status, err = pcall(RaidGrid_EventScrutiny.CheckFightStateOrg)
		if RaidGrid_EventScrutiny.bFunctionPcallErrOutput and not status and err then
			Output(err, "RaidGrid_EventScrutiny.CheckFightState")
		end
	else
		RaidGrid_EventScrutiny.CheckFightStateOrg()
	end
end

function RaidGrid_EventScrutiny.CheckFightStateOrg()
	local player = GetClientPlayer()

	if player.bFightState == true then
		RaidGrid_EventScrutiny.bSelfInFightState = true
	end
	if RaidGrid_EventScrutiny.bSelfInFightState ~= RaidGrid_EventScrutiny.bLastFightState then
		local fLogicTime = RaidGrid_Base.GetLogicTime()

		if not RaidGrid_EventScrutiny.bSelfInFightState and RaidGrid_EventScrutiny.bSelfStateOfDeathProcess then
			if player.nMoveState == MOVE_STATE.ON_DEATH then
				RaidGrid_EventScrutiny.bDeathTimeEnd = fLogicTime
				return
			else
				if (fLogicTime < (RaidGrid_EventScrutiny.bDeathTimeEnd + 5)) then
					return
				end
			end
		end
		--RaidGrid_EventScrutiny.bDeathTimeEnd = 0
		
		RaidGrid_EventScrutiny.bLastFightState = RaidGrid_EventScrutiny.bSelfInFightState

		if RaidGrid_EventScrutiny.bLastFightState then
			--if not RaidGrid_EventScrutiny.bScrutinyFightState then
				--return
			--end
			local tRecord = {}
			tRecord.szType = "Casting"
			tRecord.dwID = 1000001
			tRecord.nLevel = 1
			tRecord.szName = "Đang chiến đấu"
			tRecord.bIsVisible = true
			tRecord.nIconID = 2043
			tRecord.fEventTimeStart = fLogicTime
			tRecord.fEventTimeEnd = tRecord.fEventTimeStart + 99999999
			tRecord.tEventTimeCache = {}
			if RaidGrid_EventScrutiny.tFightStateTable then
				tRecord.tEventTimeCache = RaidGrid_EventScrutiny.tFightStateTable.tEventTimeCache or {}
				RaidGrid_EventScrutiny.tFightStateTable.fEventTimeEnd = 0
			end
			if RaidGrid_EventScrutiny.tRecords.Scrutiny.Hash2[tRecord.dwID] then
				RaidGrid_EventScrutiny.tRecords.Scrutiny.Hash2[tRecord.dwID][tRecord.nLevel] = nil
			end
			if not RaidGrid_EventScrutiny.tRecords.Scrutiny.Hash2[tRecord.dwID] or RaidGrid_Base.isTableEmpty(RaidGrid_EventScrutiny.tRecords.Scrutiny.Hash2[tRecord.dwID]) then
				RaidGrid_EventScrutiny.tRecords.Scrutiny.Hash2[tRecord.dwID] = nil
				RaidGrid_EventScrutiny.tRecords.Scrutiny.Hash[tRecord.dwID] = nil
			end
			RaidGrid_EventScrutiny.RefreshEventHandle()
			RaidGrid_EventScrutiny.AddRecordToList(tRecord, "Scrutiny")
			RaidGrid_EventScrutiny.tFightStateTable = tRecord
			RaidGrid_EventScrutiny.UpdateRecordList(RaidGrid_EventScrutiny.szListIndex)
		elseif RaidGrid_EventScrutiny.tFightStateTable then
			RaidGrid_EventScrutiny.tFightStateTable.nIconID = 2129
			RaidGrid_EventScrutiny.tFightStateTable.szName = "Rời chiến đấu"
			RaidGrid_EventScrutiny.tFightStateTable.tEventTimeCache = RaidGrid_EventScrutiny.tFightStateTable.tEventTimeCache or {}
			if RaidGrid_EventScrutiny.tFightStateTable and RaidGrid_EventScrutiny.tFightStateTable.fEventTimeStart then
				table.insert(RaidGrid_EventScrutiny.tFightStateTable.tEventTimeCache, 1, fLogicTime - RaidGrid_EventScrutiny.tFightStateTable.fEventTimeStart)
			end
		end
	end
end

function RaidGrid_EventScrutiny.RefreshEventHandle()
	local player = GetClientPlayer()
	if not player then
		return
	end
	local handle = RaidGrid_EventScrutiny.handleRecords
	if not handle then
		return
	end
	
	local tTab = RaidGrid_EventScrutiny.tRecords["Scrutiny"]
	local fLogicTime = RaidGrid_Base.GetLogicTime()
	
	local tRemoveList = {}
	for i = 1, #tTab do
		local tRecord = tTab[i]
		local szType = tRecord.szType
		if szType == "Npc" or szType == "Casting" then
			if RaidGrid_Base.IsOutOfEventTime(tRecord, tRecord.nRemoveDelayTime or RaidGrid_EventScrutiny.nRemoveDelayTime) then
				tRecord.fEventTimeStart = nil
				tRecord.fEventTimeEnd = nil
				if tTab.Hash2[tRecord.dwID] and tRecord.nLevel then
					tTab.Hash2[tRecord.dwID][tRecord.nLevel] = nil
				end
				if not tTab.Hash2[tRecord.dwID] or RaidGrid_Base.isTableEmpty(tTab.Hash2[tRecord.dwID]) then
					tTab.Hash2[tRecord.dwID] = nil
					tTab.Hash[tRecord.dwID] = nil
				end
				table.insert(tRemoveList, 1, i)
			end
		elseif szType == "Buff" or szType == "Debuff" then
			if RaidGrid_Base.IsOutOfEventTime(tRecord, tRecord.nRemoveDelayTime or 0) then
				tRecord.fEventTimeStart = nil
				tRecord.fEventTimeEnd = nil
				if tTab.Hash2[tRecord.dwID] and tRecord.nLevel then
					tTab.Hash2[tRecord.dwID][tRecord.nLevel] = nil
				end
				if not tTab.Hash2[tRecord.dwID] or RaidGrid_Base.isTableEmpty(tTab.Hash2[tRecord.dwID]) then
					tTab.Hash2[tRecord.dwID] = nil
					tTab.Hash[tRecord.dwID] = nil
				end
				table.insert(tRemoveList, 1, i)
			end
		end
	end

	for i = 1, #tRemoveList do
		table.remove(tTab, tRemoveList[i])
	end
	if RaidGrid_EventScrutiny.szListIndex == "Scrutiny" then
		RaidGrid_EventScrutiny.UpdateRecordList("Scrutiny")
	end
	
	for i = 1, 8 do
		local handleRecord = handle:Lookup("Handle_Record_" .. i)
		if handleRecord and handleRecord.tRecord and
		(handleRecord.tRecord.szType == "Npc" or handleRecord.tRecord.szType == "Casting" or handleRecord.tRecord.szType == "Buff" or handleRecord.tRecord.szType == "Debuff") then
			if RaidGrid_EventScrutiny.szListIndex == "Scrutiny" and handleRecord.tRecord.nEventAlertTime and handleRecord.tRecord.nEventAlertTime > 0 then
				local fTimeRemain = handleRecord.tRecord.fEventTimeEnd - fLogicTime
				local fP = 1
				local nFrame = 32
				if fTimeRemain >= 0 then		-- 时间没到
					if handleRecord.tRecord.szType == "Buff" then
						fP = fTimeRemain / handleRecord.tRecord.nEventAlertTime
						nFrame = 32
					elseif handleRecord.tRecord.szType == "Debuff" then
						fP = fTimeRemain / handleRecord.tRecord.nEventAlertTime
						nFrame = 30
					else
						fP = 1 - fTimeRemain / handleRecord.tRecord.nEventAlertTime
						if fP >= 0.975 or fTimeRemain < 5 then
							nFrame = 30
						elseif fP >= 0.5 then
							nFrame = 31
						end
						
						local fRemainCamp = handleRecord.tRecord.nEventCountdownTime or 10
						if player.IsInParty() and fRemainCamp > 0 and fTimeRemain <= fRemainCamp then
							if (handleRecord.tRecord.szType == "Npc" and RaidGrid_EventScrutiny.bNpcChatAlertEnable and handleRecord.tRecord.bChatAlertT) or
							(handleRecord.tRecord.szType == "Casting" and RaidGrid_EventScrutiny.bCastingChatAlertEnable and handleRecord.tRecord.bChatAlertT) then
								local fTimeRemainfloor = math.floor(fTimeRemain)
								if handleRecord.tRecord.nLastSecond and fTimeRemainfloor < handleRecord.tRecord.nLastSecond then
									local tInfo = 	{{type = "text", text = "★ [" .. (handleRecord.tRecord.szName or "????") .. "] sắp xuất hiện: " .. fTimeRemainfloor .. " giây"},}
									RE.Talk(RaidGrid_EventScrutiny.nSayChannel,tInfo)
								end
								handleRecord.tRecord.nLastSecond = fTimeRemainfloor
							end
						end
						if handleRecord.tRecord.tTimerSet and ((handleRecord.tRecord.bChatAlertCDEnd3 or 0) <= fLogicTime) then
							local tTimerSetTemp = handleRecord.tRecord.tTimerSet
							for nTimerIndex = 1, #tTimerSetTemp do
								local nTimePastTemp = fLogicTime - handleRecord.tRecord.fEventTimeStart
								local nTimeLeftTemp = tTimerSetTemp[nTimerIndex].nTime - nTimePastTemp
								if nTimeLeftTemp > 0 then
									if (nTimerIndex == 1 and nTimePastTemp < 4) or (nTimerIndex ~= 1 and nTimePastTemp > tTimerSetTemp[nTimerIndex-1].nTime and nTimePastTemp < tTimerSetTemp[nTimerIndex-1].nTime + 4) then
										RaidGrid_SkillTimer.StartNewSkillTimer(tTimerSetTemp[nTimerIndex].szTimerName,254,1,nTimeLeftTemp*16,RaidGrid_EventScrutiny.bSkillTimerSay and handleRecord.tRecord.bChatAlertT,RaidGrid_EventScrutiny.nSayChannel,false)
										handleRecord.tRecord.bChatAlertCDEnd3 = fLogicTime + 5
									end
								end
							end
						end
					end
				else							-- 时间到了延迟删除
					fTimeRemain = math.abs(fTimeRemain)
					nFrame = 30
				end
				if not handleRecord.imageTimeBar.nFrame or handleRecord.imageTimeBar.nFrame ~= nFrame then
					handleRecord.imageTimeBar.nFrame = nFrame
					handleRecord.imageTimeBar:SetFrame(nFrame)
				end
				if not handleRecord.tRecord.bNormalCountdownType then
					handleRecord:Lookup("Image_TimeBar"):SetSize(125 * fP, 17)
					handleRecord.textEventTime:SetText(RaidGrid_Base.Time2String(fTimeRemain))
				else
					handleRecord:Lookup("Image_TimeBar"):SetSize(125 * fP, 17)
					handleRecord.textEventTime:SetText(RaidGrid_Base.Time2String(fLogicTime - handleRecord.tRecord.fEventTimeStart))					
				end
			elseif RaidGrid_EventScrutiny.szListIndex == "Scrutiny" and handleRecord.tRecord.dwID == 1000001 and handleRecord.tRecord.szName == "Đang chiến đấu" then
				handleRecord:Lookup("Image_TimeBar"):SetSize(0, 17)
				handleRecord.textEventTime:SetText(RaidGrid_Base.Time2String(fLogicTime - handleRecord.tRecord.fEventTimeStart))
			else
				handleRecord:Lookup("Image_TimeBar"):SetSize(0, 17)
				if not handleRecord.tRecord.bNotAddToScrutiny and handleRecord.tRecord.szType ~= "Buff" and handleRecord.tRecord.szType ~= "Debuff" then
					handleRecord.textEventTime:SetText("Thời gian còn lại ")
				else
					handleRecord.textEventTime:SetText("Không đếm ngược")
				end
				for k,v in pairs(RaidGrid_EventScrutiny.tSkillTimerName) do
					if handleRecord.tRecord[k] then
						handleRecord.textEventTime:SetText(v)
					end
				end
			end
		end
	end
end

