RaidGrid_AlarmScreen={
	current="",
	color={255,0,255},
	alpha=255,
	anchor={s = "CENTER", r = "CENTER",x=0,y=80},
	defanchor={s = "CENTER", r = "CENTER",x=0,y=80},
}
RegisterCustomData("RaidGrid_AlarmScreen.anchor")

RaidGrid_AlarmScreen.FontScale = 3
RegisterCustomData("RaidGrid_AlarmScreen.FontScale")
RaidGrid_AlarmScreen.bEnable = true
RegisterCustomData("RaidGrid_AlarmScreen.bEnable") 

function RaidGrid_AlarmScreen.UpdateText(szText,tColor)
	if RaidGrid_EventScrutiny.bFunctionPcallRunMode then
		local status, err = pcall(RaidGrid_AlarmScreen.UpdateTextOrg,szText,tColor)
		if RaidGrid_EventScrutiny.bFunctionPcallErrOutput and not status and err then
			Output(err, "RaidGrid_AlarmScreen.UpdateText",szText,tColor)
		end
	else
		RaidGrid_AlarmScreen.UpdateTextOrg(szText,tColor)
	end
end

function RaidGrid_AlarmScreen.UpdateTextOrg(szText,tColor)
	if not RaidGrid_AlarmScreen.bEnable then
		return
	end
	RaidGrid_AlarmScreen.current=szText
	if (not tColor) then
		RaidGrid_AlarmScreen.color={255,0,255}
	else
		RaidGrid_AlarmScreen.color=tColor
	end
	RaidGrid_AlarmScreen.alpha=255
end

function RaidGrid_AlarmScreen.OnFrameBreathe()
	local Player = GetClientPlayer()
	if not Player then
		return
	end
	if RaidGrid_AlarmScreen.alpha>0 then
		 local handle=this:Lookup("", "Text_Total")		 
		 handle:SetText(RaidGrid_AlarmScreen.current)
		 handle:SetFontScheme(23)
		 handle:SetFontColor(RaidGrid_AlarmScreen.color[1], RaidGrid_AlarmScreen.color[2], RaidGrid_AlarmScreen.color[3])
		 handle:SetFontScale(RaidGrid_AlarmScreen.FontScale)
		 --handle:AutoSize()				    
		 handle:SetAlpha(RaidGrid_AlarmScreen.alpha)
		 if RaidGrid_AlarmScreen.alpha>200 then
			RaidGrid_AlarmScreen.alpha=RaidGrid_AlarmScreen.alpha-2
		 elseif RaidGrid_AlarmScreen.alpha>40 then
			RaidGrid_AlarmScreen.alpha=RaidGrid_AlarmScreen.alpha-10
		 else
			RaidGrid_AlarmScreen.alpha=0
			handle:SetText("")
		 end
	 end
end

function RaidGrid_AlarmScreen.OnFrameCreate()
	this:RegisterEvent("CUSTOM_DATA_LOADED")
    this:RegisterEvent("ON_ENTER_CUSTOM_UI_MODE")
	this:RegisterEvent("ON_LEAVE_CUSTOM_UI_MODE")
