	for i=1, nFrmCnt, 1 do
		hFrame = RaidGrid_SkillTimer2.GetFrame(RaidGrid_SkillTimer2.nCount)
		hFrame:Hide()
		hFrame.szSkillName = ""
		hFrame.nSkillID = 0
		hFrame.nSkillLV = 0
		hFrame.bSayTimer = false
		hFrame.nChannel = nil
		hFrame.bBuff = false
		RaidGrid_SkillTimer2.nCount = RaidGrid_SkillTimer2.nCount - 1
	end	
end

function RaidGrid_SkillTimer2.FreshBox(frame)
	local szSkillName = frame.szSkillName
	local nSkillID = frame.nSkillID
	local nSkillLV = frame.nSkillLV
	local box = frame:Lookup("",""):Lookup("Box")
	box:SetObject(UI_OBJECT_SKILL, nSkillID, nSkillLV)
	if not frame.bBuff then
		box:SetObjectIcon(Table_GetSkillIconID(nSkillID, nSkillLV))
	else
		box:SetObjectIcon(Table_GetBuffIconID(nSkillID, nSkillLV))
	end
	local text = frame:Lookup("",""):Lookup("SkillName")
	text:SetText(szSkillName)
end

function RaidGrid_SkillTimer2.FreshPos(frame)
	local y = RaidGrid_SkillTimerAnchor2.Anchor.y + (frame.nID) * 33
	frame:SetPoint(RaidGrid_SkillTimerAnchor2.Anchor.s, 0, 0, RaidGrid_SkillTimerAnchor2.Anchor.r, RaidGrid_SkillTimerAnchor2.Anchor.x, y)
	frame:CorrectPos()
end

function RaidGrid_SkillTimer2.GetFrame(index)
	local hTimerFrame = Station.Lookup("Normal/RaidGrid_SkillTimer2_" .. index)
	return hTimerFrame
end

function RaidGrid_SkillTimer2.StartNewSkillTimer(szSkillName, nSkillID, nSkillLV, nFrameCount, bSayTimer, nChannel , bBuff)
	if RaidGrid_EventScrutiny.bFunctionPcallRunMode then
		local status, err = pcall(RaidGrid_SkillTimer2.StartNewSkillTimerOrg, szSkillName, nSkillID, nSkillLV, nFrameCount, bSayTimer, nChannel, bBuff)
		if RaidGrid_EventScrutiny.bFunctionPcallErrOutput and not status and err then
			Output(err, "RaidGrid_SkillTimer2.StartNewSkillTimer", szSkillName, nSkillID, nSkillLV, nFrameCount, bSayTimer, nChannel, bBuff)
		end
	else
		RaidGrid_SkillTimer2.StartNewSkillTimerOrg(szSkillName, nSkillID, nSkillLV, nFrameCount, bSayTimer, nChannel, bBuff)
	end
end

function RaidGrid_SkillTimer2.StartNewSkillTimerOrg(szSkillName, nSkillID, nSkillLV, nFrameCount, bSayTimer, nChannel, bBuff)
	local nStartFrmCount = GetLogicFrameCount()
	local nEndFrmCount = nStartFrmCount + nFrameCount
	RaidGrid_SkillTimer2.nCount = RaidGrid_SkillTimer2.nCount + 1
	local hTimerFrame = Station.Lookup("Normal/RaidGrid_SkillTimer2_" .. RaidGrid_SkillTimer2.nCount)
	if not hTimerFrame then
		hTimerFrame = Wnd.OpenWindow(SKILL_TIMER_INI2, "RaidGrid_SkillTimer2_" .. RaidGrid_SkillTimer2.nCount)
		hTimerFrame.nID = RaidGrid_SkillTimer2.nCount
		hTimerFrame.OnFrameRender = RaidGrid_SkillTimer2.OnFrameRender
	else		
	end

	local index = 1
	local bSameSkillIDFind = false
	for i=1, RaidGrid_SkillTimer2.nCount - 1, 1 do
		local frm = RaidGrid_SkillTimer2.GetFrame(i)
		if (nSkillID == frm.nSkillID) then
			bSameSkillIDFind = true
		end
		if bSameSkillIDFind and (nEndFrmCount < frm.nEndFrameCount or nSkillID ~= frm.nSkillID) then
			break
		end
		index = i + 1
	end
	for i=RaidGrid_SkillTimer2.nCount, index + 1, -1 do
		local pre = RaidGrid_SkillTimer2.GetFrame(i)
		local post = RaidGrid_SkillTimer2.GetFrame(i-1)
		RaidGrid_SkillTimer2.CopyFrame(pre, post)
	end
	
	hTimerFrame = RaidGrid_SkillTimer2.GetFrame(index)	
	
	hTimerFrame.szSkillName = szSkillName
	hTimerFrame.nSkillID = nSkillID
	hTimerFrame.nSkillLV = nSkillLV
	hTimerFrame.nStartFrameCount = nStartFrmCount
	hTimerFrame.nEndFrameCount = nEndFrmCount
	hTimerFrame.bSayTimer = bSayTimer
	hTimerFrame.nChannel = nChannel
	hTimerFrame.bBuff = bBuff
	
	RaidGrid_SkillTimer2.init(hTimerFrame)
	hTimerFrame:Show()
	
	for i=1, RaidGrid_SkillTimer2.nCount, 1 do
		if i ~= index then
			local hTimerFrame2 = RaidGrid_SkillTimer2.GetFrame(i)
			if hTimerFrame2.szSkillName == szSkillName then
				RaidGrid_SkillTimer2.RemoveTimer(i)
				return
			end
		end
	end
end

function RaidGrid_SkillTimer2.ShowOrHideAllTimer()
	if RaidGrid_SkillTimer2.nCount > 0 then
		local hTimerFrame = Station.Lookup("Normal/RaidGrid_SkillTimer2_1")
		local bOpen = hTimerFrame:IsVisible()
		for i = 1, RaidGrid_SkillTimer2.nCount, 1 do
			hTimerFrame = Station.Lookup("Normal/RaidGrid_SkillTimer2_" .. i)
			if bOpen then
				hTimerFrame:Hide()
			else
				hTimerFrame:Show()
			end
		end
		if bOpen then
			RaidGrid_Base.Message("Ẩn nhiều mục tiêu tính giờ")
		else
			RaidGrid_Base.Message("Hiển thị nhiều mục tiêu tính giờ.")
		end
	else
		RaidGrid_Base.Message("Hiện tại không có nhiều mục tiêu tính giờ")
	end
end
