RaidGrid_ScreenHead = {
	tFrameInfo = {}, -- 全部丢到这里
	tHeadList = {}
}

RaidGrid_ScreenHead.nRenderCount = -1
RaidGrid_ScreenHead.firstCreate = true

function RaidGrid_ScreenHead.GetHeadList(dwID)
	for k, v in pairs(RaidGrid_ScreenHead.tHeadList[dwID]) do
		return v
	end
	return false
end

function RaidGrid_ScreenHead.updateAllFrameInfo()
	local alarmList = Station.Lookup("Lowest/RaidGrid_ScreenHead", "")
	local nCount = alarmList:GetItemCount()
	for i = 0, nCount - 1 do
		local alarmItem = alarmList:Lookup(i)
		if not (not alarmItem) then
			local hPlayer = GetPlayer(alarmItem.dwID)
			if not hPlayer or hPlayer.nMoveState == MOVE_STATE.ON_DEATH then
				alarmList:RemoveItem(i)
				RaidGrid_ScreenHead.tFrameInfo[alarmItem.dwID] = nil
			else
				local sText = ""
				do
					if alarmItem.aType == "Buff" or alarmItem.aType == "Debuff" then
						local tBuffList = ReplicaGetBuffList(hPlayer) or {}
						for _,tBuff in pairs(tBuffList) do
							--local szBuffName = Table_GetBuffName(tBuff.dwID, tBuff.nLevel)
							--if tostring(szBuffName) == alarmItem.aText then
							if tBuff.dwID == alarmItem.dwBuffID then
								--时间转化
								local nLogic = GetLogicFrameCount()
								local showTimes = RaidGrid_Base.Time2String(((tBuff.nEndFrame or nLogic) - nLogic) / GLOBAL.GAME_FPS)
								if showTimes ~= "" then
									showTimes = "_" .. showTimes
								end
								if tBuff.bCanCancel and alarmItem.aType == "Buff" then
									if tBuff.nStackNum > 1 then
										sText = alarmItem.aText .. "(" .. tBuff.nStackNum .. ")" .. showTimes
									else
										sText = alarmItem.aText .. showTimes
									end
									
								elseif not tBuff.bCanCancel and alarmItem.aType == "Debuff" then
									if tBuff.nStackNum > 1 then
										sText = alarmItem.aText .. "(" .. tBuff.nStackNum .. ")" .. showTimes
									else
										sText = alarmItem.aText .. showTimes
									end
								end
							end
						end
					elseif alarmItem.aType == "life" or alarmItem.aType == "mana" then
						local hPlayer2 = GetClientTeam().GetMemberInfo(alarmItem.dwID)
						if hPlayer2 and not hPlayer2.bDeathFlag and hPlayer2.bIsOnLine then
							local lifeper = hPlayer2.nCurrentLife / hPlayer2.nMaxLife
							local manaper = hPlayer2.nCurrentMana / hPlayer2.nMaxMana
							
							if alarmItem.aType == "life" and RaidGrid_EventScrutiny.nLifeHeadPer >= lifeper then
								sText = "Khí huyết không đủ " .. "(" .. hPlayer2.nCurrentLife .. "/" .. hPlayer2.nMaxLife .. ")"
							elseif alarmItem.aType == "mana" and RaidGrid_EventScrutiny.nManaHeadPer >= manaper then
								sText = "Nội lực không đủ " .. "(" .. hPlayer2.nCurrentMana .. "/" .. hPlayer2.nMaxMana .. ")"
							end
						end
					elseif alarmItem.aType == "timer" then
						--时间转化
						local nLogic = GetLogicFrameCount()
						if (alarmItem.nEndFrame or nLogic) > nLogic then
							local showTimes = RaidGrid_Base.Time2String(((alarmItem.nEndFrame or nLogic) - nLogic) / GLOBAL.GAME_FPS)
							if showTimes ~= "" then
								showTimes = "_" .. showTimes
							end
							sText = alarmItem.aText .. showTimes
						end
					end
					
					
					RaidGrid_ScreenHead.tFrameInfo[alarmItem.dwID].hText = sText
					
					if (alarmItem.aType == "Buff" or alarmItem.aType == "Debuff") and sText == "" and ReplicaGetBuffList(hPlayer) then
						RaidGrid_ScreenHead.tHeadList[alarmItem.dwID][alarmItem.dwBuffID] = nil
						alarmList:RemoveItem(i)
						RaidGrid_ScreenHead.tFrameInfo[alarmItem.dwID] = nil
						local NextHead = RaidGrid_ScreenHead.GetHeadList(alarmItem.dwID)
						if NextHead then
							RaidGrid_ScreenHead.addAlarmFrame(alarmItem.dwID,NextHead)
						end
					elseif (alarmItem.aType == "life" or alarmItem.aType == "mana") and sText == "" then
						RaidGrid_ScreenHead.tHeadList[alarmItem.dwID][alarmItem.aType] = nil
						alarmList:RemoveItem(i)
						RaidGrid_ScreenHead.tFrameInfo[alarmItem.dwID] = nil
						local NextHead = RaidGrid_ScreenHead.GetHeadList(alarmItem.dwID)
						if NextHead then
							RaidGrid_ScreenHead.addAlarmFrame(alarmItem.dwID,NextHead)
						end
					elseif (alarmItem.aType == "timer") and sText == "" then
						RaidGrid_ScreenHead.tHeadList[alarmItem.dwID][alarmItem.aType] = nil
						alarmList:RemoveItem(i)
						RaidGrid_ScreenHead.tFrameInfo[alarmItem.dwID] = nil
						local NextHead = RaidGrid_ScreenHead.GetHeadList(alarmItem.dwID)
						if NextHead then
							RaidGrid_ScreenHead.addAlarmFrame(alarmItem.dwID,NextHead)
						end
					else
						local nDistance = GetCharacterDistance(GetClientPlayer().dwID, hPlayer.dwID)
						RaidGrid_ScreenHead.tFrameInfo[alarmItem.dwID].dText = string.format("%.1f", nDistance / 64) .. " thước"
					end
					
				end
			end
		end
	end
	if RaidGrid_ScreenHead.nRenderCount % 16 == 0 then
		alarmList:Sort()
	end
end

function RaidGrid_ScreenHead.addAlarmFrame(dwID, tRecord, bOld)
	if RaidGrid_EventScrutiny.bFunctionPcallRunMode then
		local status, err = pcall(RaidGrid_ScreenHead.addAlarmFrameOrg, dwID, tRecord, bOld)
		if RaidGrid_EventScrutiny.bFunctionPcallErrOutput and not status and err then
			Output(err, "RaidGrid_ScreenHead.addAlarmFrame", dwID, tRecord, bOld)
		end
	else
		RaidGrid_ScreenHead.addAlarmFrameOrg(dwID, tRecord, bOld)
	end
end

function RaidGrid_ScreenHead.addAlarmFrameOrg(dwID, tRecord, bOld)
	local hPlayer = GetPlayer(dwID)
	if not hPlayer or hPlayer.nMoveState == MOVE_STATE.ON_DEATH then
		return 
	end
	local sText = tRecord.szName
	local nEndFrame = tRecord.nEndFrame or tonumber(GetLogicFrameCount()+RaidGrid_EventScrutiny.nBeCalledTimerHead*GLOBAL.GAME_FPS)
	local dwBuffID = tRecord.dwID
	local frameType = tRecord.szType
	local handle = Station.Lookup("Lowest/RaidGrid_ScreenHead", "")
	local nhandle = handle:Lookup(dwID .. "")
	if nhandle and ((tRecord.nPriorityLevel or 1) <= nhandle.nPriorityLevel) and bOld then
		return
	end
	if not nhandle then
		nhandle = handle:AppendItemFromIni("Interface/RaidGrid_EventScrutiny/RaidGrid_ScreenHead.ini", "Handle_Label", dwID .. "")
		nhandle.dwID = dwID
		nhandle.KGPlayer = hPlayer
		nhandle.aType = frameType
		nhandle.nPriorityLevel = tRecord.nPriorityLevel or 1
		nhandle.aText = sText
		nhandle.nEndFrame = nEndFrame
		nhandle.dwBuffID = dwBuffID
		nhandle.s = 1
		nhandle:Lookup("Shadow_Arrow"):SetTriangleFan(true)
	elseif nhandle.dwBuffID == dwBuffID then
		return
	end
	--优先级判定
	if (tRecord.nPriorityLevel or 1) < nhandle.nPriorityLevel then
		return 
	end
	nhandle.aType = frameType
	nhandle.aText = sText
	nhandle.nEndFrame = nEndFrame
	nhandle.dwBuffID = dwBuffID
	nhandle.nPriorityLevel = tRecord.nPriorityLevel or 1

	local color = {}
	if frameType == "Buff" then
		nhandle.fontColor = {255, 128, 0}
		color.bgColor = {0, 255, 0}
		if tRecord.tRGBuffColor and not (tRecord.tRGBuffColor[1]==0 and tRecord.tRGBuffColor[2]==0 and tRecord.tRGBuffColor[3]==0) then
			color.bgColor[1] = tRecord.tRGBuffColor[1]
			color.bgColor[2] = tRecord.tRGBuffColor[2]
			color.bgColor[3] = tRecord.tRGBuffColor[3]
		end
		
	elseif frameType == "Debuff" then
		nhandle.fontColor = {255, 0, 255}
		color.bgColor = {255, 0, 0}
		if tRecord.tRGBuffColor and not (tRecord.tRGBuffColor[1]==0 and tRecord.tRGBuffColor[2]==0 and tRecord.tRGBuffColor[3]==0) then
			color.bgColor[1] = tRecord.tRGBuffColor[1]
			color.bgColor[2] = tRecord.tRGBuffColor[2]
			color.bgColor[3] = tRecord.tRGBuffColor[3]
		end
	elseif frameType == "timer" then
		nhandle.fontColor = {128, 255, 255}
		color.bgColor = {255, 0, 0}
	elseif frameType == "life" then
		nhandle.fontColor = {128, 255, 255}
		color.bgColor = {255, 0, 0}
	elseif frameType == "mana" then
		nhandle.fontColor = {255, 255, 128}
		color.bgColor = {0, 0, 255}
	end
	
	local nDistance = GetCharacterDistance(GetClientPlayer().dwID, dwID)
	
	nhandle.nText = hPlayer.szName
	nhandle.hText = sText .. ""
	nhandle.dText = string.format("%.1f", nDistance / 64) .. " thước"
	nhandle.arrow = {}
	nhandle.arrow.col = {color.bgColor[1],color.bgColor[2],color.bgColor[3]}
	RaidGrid_ScreenHead.tFrameInfo[nhandle.dwID] = nhandle

	nhandle:Show()
	RaidGrid_ScreenHead.updateFramePos(nhandle)
	RaidGrid_ScreenHead.createArrow(nhandle)
	
	if not RaidGrid_ScreenHead.tHeadList[dwID] then
		RaidGrid_ScreenHead.tHeadList[dwID] = {}
	end
	if frameType == "Buff" or frameType == "Debuff" then
		RaidGrid_ScreenHead.tHeadList[dwID][dwBuffID] = tRecord
	else
		RaidGrid_ScreenHead.tHeadList[dwID][frameType] = tRecord
	end
end

RaidGrid_ScreenHead.arrow = {
	color = {r = 56, g = 81, b = 94}, 
	pointCenter = {x = 25, y = 25, a = 180}, 
	point = {
		{x = 15, y = 0, a = 100}, 
		{x = 35, y = 0, a = 100}, 
		{x = 35, y = 25, a = 180}, 
		{x = 43, y = 25, a = 255}, 
		{x = 25, y = 50, a = 180}, 
		{x = 7, y = 25, a = 255}, 
		{x = 15, y = 25, a = 180}
	}
}

function RaidGrid_ScreenHead.createArrow(nhandle)
	local hPlayer
	if GetClientPlayer().IsInParty() then
		hPlayer = GetClientTeam().GetMemberInfo(nhandle.dwID)
	end
	if not hPlayer then
		hPlayer = GetPlayer(nhandle.dwID)
	end
	local lifeper = hPlayer.nCurrentLife / hPlayer.nMaxLife
	local manaper = hPlayer.nCurrentMana / hPlayer.nMaxMana
	if lifeper > 1 then
		lifeper = 1
	end
	if lifeper < 0 then
		lifeper = 0
	end
	if manaper > 1 then
		manaper = 1
	end
	if manaper < 0 then
		manaper = 0
	end

	local bg = nhandle:Lookup("Shadow_InfoBG")
	local HP = nhandle:Lookup("Shadow_InfoHP")
	local MP = nhandle:Lookup("Shadow_InfoMP")
	local bcX,bcY = -50 , -50
	
	HP:SetTriangleFan(GEOMETRY_TYPE.TRIANGLE)
	HP:SetD3DPT(D3DPT.TRIANGLEFAN)
	HP:ClearTriangleFanPoint()
	
	MP:SetTriangleFan(GEOMETRY_TYPE.TRIANGLE)
	MP:SetD3DPT(D3DPT.TRIANGLEFAN)
	MP:ClearTriangleFanPoint()
	
	bg:SetTriangleFan(GEOMETRY_TYPE.TRIANGLE)
	bg:SetD3DPT(D3DPT.TRIANGLEFAN)
	bg:ClearTriangleFanPoint()
	
	bg:AppendCharacterID(nhandle.dwID,true,255,255,255,255,{0,0,0,bcX,bcY})
	bg:AppendCharacterID(nhandle.dwID,true,255,255,255,255,{0,0,0,bcX+100,bcY})
	bg:AppendCharacterID(nhandle.dwID,true,255,255,255,255,{0,0,0,bcX+100,bcY-10})
	bg:AppendCharacterID(nhandle.dwID,true,255,255,255,255,{0,0,0,bcX,bcY-10})
	
	MP:AppendCharacterID(nhandle.dwID,true,50,100,255,255,{0,0,0,bcX,bcY})
	MP:AppendCharacterID(nhandle.dwID,true,50,100,255,255,{0,0,0,bcX+(100*manaper),bcY})
	MP:AppendCharacterID(nhandle.dwID,true,50,100,255,255,{0,0,0,bcX+(100*manaper),bcY-5})
	MP:AppendCharacterID(nhandle.dwID,true,50,100,255,255,{0,0,0,bcX,bcY-5})
	
	local bcX,bcY = -50 , -55
	HP:AppendCharacterID(nhandle.dwID,true,220,40,0,255,{0,0,0,bcX,bcY})
	HP:AppendCharacterID(nhandle.dwID,true,220,40,0,255,{0,0,0,bcX+(100*lifeper),bcY})
	HP:AppendCharacterID(nhandle.dwID,true,220,40,0,255,{0,0,0,bcX+(100*lifeper),bcY-5})
	HP:AppendCharacterID(nhandle.dwID,true,220,40,0,255,{0,0,0,bcX,bcY-5})
	
	
	local s = nhandle:Lookup("Shadow_Arrow")
	local r,g,b = unpack(RaidGrid_ScreenHead.tFrameInfo[nhandle.dwID].arrow.col)
	local a = RaidGrid_ScreenHead.arrow.pointCenter.a
	local cX,cY = RaidGrid_ScreenHead.arrow.pointCenter.x,RaidGrid_ScreenHead.arrow.pointCenter.y
	nhandle.fY = nhandle.fY or 0
	local fX,fY = 25,50
	if nhandle.s == 1 then
		nhandle.fY = nhandle.fY + 2
		if nhandle.fY >= 10 then
			nhandle.s = 0
		end
	else
		nhandle.fY = nhandle.fY - 2
		if nhandle.fY <= 0 then
			nhandle.s = 1
		end
	end
	fY = fY - nhandle.fY
	--根据镜头调整
	
	local nDistance = GetCharacterDistance(GetClientPlayer().dwID, nhandle.dwID)

	fCameraToObjectEyeScale = tonumber(string.format("%.1f", nDistance / 64))
	if fCameraToObjectEyeScale > 30 then
		fCameraToObjectEyeScale = 30
	end
	fX = fX - fX * fCameraToObjectEyeScale * 0.011
	fCameraToObjectEyeScale = 1 - fCameraToObjectEyeScale * 0.01

	s:SetTriangleFan(GEOMETRY_TYPE.TRIANGLE)
	s:SetD3DPT(D3DPT.TRIANGLEFAN)
	s:ClearTriangleFanPoint()
	s:AppendCharacterID(nhandle.dwID,true,r,g,b,a,{0,0,0,cX*fCameraToObjectEyeScale-fX,cY*fCameraToObjectEyeScale-fY})
	for k,v in ipairs(RaidGrid_ScreenHead.arrow.point) do
		s:AppendCharacterID(nhandle.dwID,true, r,g,b,v.a,{0,0,0,v.x*fCameraToObjectEyeScale-fX,v.y*fCameraToObjectEyeScale-fY})
	end
	s:AppendCharacterID(nhandle.dwID,true, r,g,b,a,{0,0,0,RaidGrid_ScreenHead.arrow.point[1].x*fCameraToObjectEyeScale-fX,RaidGrid_ScreenHead.arrow.point[1].y*fCameraToObjectEyeScale-fY})
end


function RaidGrid_ScreenHead.updateAllFramePos()
	local handle = Station.Lookup("Lowest/RaidGrid_ScreenHead", "")
	for i = 0, handle:GetItemCount() - 1 do
		local fh = handle:Lookup(i)
		if fh then
			RaidGrid_ScreenHead.updateFramePos(fh)
		end
	end
end


function RaidGrid_ScreenHead.updateFramePos(frame)
	table.insert(BossfaceAlertUpdateAlertName,{frame.dwID,-1,frame.hText,frame.fontColor,true,187,1,{0,0,0,0,-80}})
	table.insert(BossfaceAlertUpdateAlertName,{frame.dwID,-1,frame.dText,frame.fontColor,true,187,1,{0,0,0,0,-95}})
	table.insert(BossfaceAlertUpdateAlertName,{frame.dwID,-1,frame.nText,frame.fontColor,true,187,1,{0,0,0,0,-110}})
end


function RaidGrid_ScreenHead.updateAllFrameRelPos()
	local handle = Station.Lookup("Lowest/RaidGrid_ScreenHead", "")
	for i = 0, handle:GetItemCount() - 1 do
		local fh = handle:Lookup(i)
		if fh then
			RaidGrid_ScreenHead.createArrow(fh)
			--RaidGrid_ScreenHead.updateFrameRelPos(fh)
		end
	end
end



function RaidGrid_ScreenHead.OnFrameCreate()
	if RaidGrid_ScreenHead.firstCreate then
		RaidGrid_ScreenHead.firstCreate = false
		this:RegisterEvent("BUFF_UPDATE")
		this:RegisterEvent("RENDER_FRAME_UPDATE")
		this:RegisterEvent("PARTY_UPDATE_MEMBER_LMR")
		this:RegisterEvent("SYS_MSG")
		local handle = Station.Lookup("Lowest/RaidGrid_ScreenHead", "")
		handle:Clear()
	end
end

function RaidGrid_ScreenHead.OnFrameBreathe()
	RaidGrid_ScreenHead.nRenderCount = RaidGrid_ScreenHead.nRenderCount + 1
	if RaidGrid_ScreenHead.nRenderCount > 1000000 then
		RaidGrid_ScreenHead.nRenderCount = 1
	end
	--开关
	if RaidGrid_EventScrutiny.bScreenHeadMonitor then
		RaidGrid_ScreenHead.updateAllFrameRelPos()
		--if RaidGrid_ScreenHead.nRenderCount % 8 == 0 then
			RaidGrid_ScreenHead.updateAllFrameInfo()
		--end
	elseif RaidGrid_ScreenHead.nRenderCount % 8 == 0 then
		local handle = Station.Lookup("Lowest/RaidGrid_ScreenHead", "")
		handle:Clear()
	end
end

function RaidGrid_ScreenHead.OnEvent(event)
	if event == "RENDER_FRAME_UPDATE" then
		RaidGrid_ScreenHead.updateAllFramePos()
	elseif arg0 == "UI_OME_DEATH_NOTIFY" then
		local handle = Station.Lookup("Lowest/RaidGrid_ScreenHead", "")
		local hMember = handle:Lookup(arg1 .. "")
		if hMember then
			handle:RemoveItem(arg1 .. "")
			return 
		end
	end
end

function RaidGrid_ScreenHead.IsOpened()
	local frame = Station.Lookup("Lowest/RaidGrid_ScreenHead")
	if frame then
		return true
	end
	return false
end

function RaidGrid_ScreenHead.Close()
	if not RaidGrid_ScreenHead.IsOpened() then
		return 
	end
	Wnd.CloseWindow("RaidGrid_ScreenHead")
	--PlaySound(RaidGrid_EventScrutiny.nSoundChannel, g_sound.CloseFrame)
end

function RaidGrid_ScreenHead.Open()
	if RaidGrid_ScreenHead.IsOpened() then
		return 
	end
	RaidGrid_ScreenHead.firstCreate = true
	Wnd.OpenWindow("interface\\RaidGrid_EventScrutiny\\RaidGrid_ScreenHead.ini", "RaidGrid_ScreenHead")
	--PlaySound(RaidGrid_EventScrutiny.nSoundChannel, g_sound.CloseFrame)
end

function RaidGrid_ScreenHead.Control()
	if RaidGrid_EventScrutiny.bScreenHeadMonitor then
		RaidGrid_ScreenHead.Open()
	else
		RaidGrid_ScreenHead.Close()
	end
end

