--RaidGrid_BossCallAlert.LoadSettingsFileNew("RaidGrid_BossCallAlert_Default.dat", true)
function RaidGrid_BossCallAlert.LoadSettingsFileNew(szName, bOverride)
	if not LoadLUAData then
		return
	end
	
	if not szName or szName == "" then
		szName = "RaidGrid_BossCallAlert_Default.dat"
	end
	
	local szFullName = "\\Interface\\RaidGrid_EventScrutiny\\" .. szName
	
	RaidGrid_BossCallAlert_tRecords_New = {}	
	RaidGrid_BossCallAlert_tRecords_New = LoadLUAData(szFullName)
	
	if not RaidGrid_BossCallAlert_tRecords_New or next(RaidGrid_BossCallAlert_tRecords_New) == nil then
		RaidGrid_Base.Message("Không tìm thấy đường dẫn phù hợp của file thông báo: " .. szFullName)
		return
	end
	
	RaidGrid_BossCallAlert.tRecords = RaidGrid_BossCallAlert_tRecords_New
	
	RaidGrid_Base.Message("Tải file thông báo màn hình: " .. szFullName)
end

