	}
function RaidGrid_BossCallAlert.tPopOptions(szType)
	local tOptions = {
				szOption = RaidGrid_BossCallAlert.tRecordsNames[szType],
			}
	for i = 1, #RaidGrid_BossCallAlert.tRecords[szType], 1 do
		local tRecord = RaidGrid_BossCallAlert.tRecords[szType][i]
		local tMenu = {
			szOption = tRecord.szName, 
			bCheck = true,
			bChecked = tRecord.bOn,
			fnAction = function() 
				tRecord.bOn = not tRecord.bOn
			end, 
			fnAutoClose = function() return true end}
		local tMenuNewName = {
			szOption = "Định nghĩa tên: " .. tRecord.szName,
			bCheck = false,
			bChecked = false,
			fnAction = function()
				RaidGrid_BossCallAlert.SetNewName(tRecord)
			end,
			fnAutoClose = function() return true end}
		local tMenuNewBossName = {
			szOption = "Tên NPC: " .. (tRecord.szBossName or "Không xác định"),
			bCheck = false,
			bChecked = false,
			fnAction = function()
				RaidGrid_BossCallAlert.SetNewBossName(tRecord)
			end,
			fnAutoClose = function() return true end}
		local tMenuNewText = {
			szOption = "Nội dung thông báo 1: " .. (tRecord.szText or "Không xác định"),
			bCheck = false,
			bChecked = false,
			fnAction = function()
				RaidGrid_BossCallAlert.SetNewText(tRecord)
			end,
			fnAutoClose = function() return true end}
		local tMenuNewTime1 = {
			szOption = "Thời gian cooldown 1:" .. tostring(tRecord.nTime1 or 0) .. " giây",
			bCheck = false,
			bChecked = false,
			fnAction = function()
				RaidGrid_BossCallAlert.SetNewTime1(tRecord)
			end,
			fnAutoClose = function() return true end}
		local tMenuNewName2 = {
			szOption = "Nội dung thông báo 2: " .. (tRecord.szName2 or "Không xác định"),
			bCheck = false,
			bChecked = false,
			fnAction = function()
				RaidGrid_BossCallAlert.SetNewName2(tRecord)
			end,
			fnAutoClose = function() return true end}
		local tMenuNewTime2 = {
			szOption = "Thời gian cooldown 2: " .. tostring(tRecord.nTime2 or 0) .. " giây",
			bCheck = false,
			bChecked = false,
			fnAction = function()
				RaidGrid_BossCallAlert.SetNewTime2(tRecord)
			end,
			fnAutoClose = function() return true end}
		local tMenuCheck1 = {
				szOption = "Mở thông báo kênh đoàn đội", bCheck = true, bChecked = tRecord.bRAID, fnAction = function(UserData, bCheck)
					tRecord.bRAID = bCheck
				end
			}
		local tMenuCheck2 = {
				szOption = "Mở thông báo kênh mật", bCheck = true, bChecked = tRecord.bWHISPER, fnAction = function(UserData, bCheck)
					tRecord.bWHISPER = bCheck
				end
			}
		local tMenuCheck3 = {
				szOption = "Mở nhắc nhở màu sắc toàn màn hình", bCheck = true, bChecked = tRecord.bFlash, fnAction = function(UserData, bCheck)
					tRecord.bFlash = bCheck
				end
			}
		local tMenuCheck4 = {
				szOption = "Mở nhắc nhở văn bản trung tâm", bCheck = true, bChecked = tRecord.bCenterAlarm, fnAction = function(UserData, bCheck)
					tRecord.bCenterAlarm = bCheck
				end
			}
		local tMenuRemove = {
			szOption = "Xoá thiết lập",
			fnAction = function()
				table.remove(RaidGrid_BossCallAlert.tRecords[szType], i)
			end}
		table.insert(tMenu, tMenuNewName)
		table.insert(tMenu, {bDevide = true} )
		if szType == "tBossCall" then
			table.insert(tMenu, tMenuNewBossName)
		end
		table.insert(tMenu, tMenuNewText)
		table.insert(tMenu, {bDevide = true} )
		table.insert(tMenu, tMenuNewTime1)
		table.insert(tMenu, {bDevide = true} )
		table.insert(tMenu, tMenuNewName2)
		table.insert(tMenu, tMenuNewTime2)
		table.insert(tMenu, {bDevide = true} )
		table.insert(tMenu, tMenuCheck1)
		table.insert(tMenu, tMenuCheck2)
		table.insert(tMenu, {bDevide = true} )
		table.insert(tMenu, tMenuCheck3)
		table.insert(tMenu, tMenuCheck4)
		table.insert(tMenu, {bDevide = true} )
		table.insert(tMenu, tMenuRemove)
		table.insert(tOptions, tMenu)
	end
	table.insert(tOptions, {bDevide = true})
	local tMenuAdd = {
		szOption = "Thêm thiết lập: ",
		fnAction = function()
			GetUserInput("Nhập tên: ", function(szText) RaidGrid_BossCallAlert.AddList(szType, szText) end, nil, nil, nil, nil)
		end}
	table.insert(tOptions, tMenuAdd)
	return tOptions
end


