function RaidGrid_EventScrutiny.SyncOptions(tData,szType)
	
	local tOptions = {szOption = "Chia sẻ dữ liệu trong nhóm",rgb = {255,128,192},
		{szOption = "Chia sẻ với tất cả thành viên trong nhóm",fnAction = function() RaidGrid_Base.SendDataToTeam(tData,szType)	end},
	}	
	local tForceCol = {
		[0] = {255,255,255},
		[1] = {255,255,170},
		[2] = {175,25,255},
		[3] = {255,75,100},
		[4] = {0,255,255},
		[5] = {255,128,255},
		[6] = {140,80,255},
		[7] = {0,255,0},
		[8] = {255,200,0},
		[9] = {185,125,60},
		[10] = {240,50,200},
	}
	if GetClientPlayer().IsInParty() then
		table.insert(tOptions,{bDevide = true})
		local hTeam = GetClientTeam()
		for i = 0, hTeam.nGroupNum - 1 do
			local tGroupInfo = hTeam.GetGroupInfo(i)
			for _, dwID in pairs(tGroupInfo.MemberList) do
				local tMemberInfo = hTeam.GetMemberInfo(dwID)
				if tMemberInfo.szName ~= GetClientPlayer().szName then
					local szIcon,nFrame = GetForceImage(tMemberInfo.dwForceID)
					local col = tForceCol[tMemberInfo.dwForceID] or {255,255,255}
					table.insert(tOptions,{szOption = tMemberInfo.szName,bDisable = not tMemberInfo.bIsOnLine,rgb = col, szIcon = szIcon,szLayer = "ICON_RIGHT",nFrame = nFrame ,fnAction = function() RaidGrid_Base.SendDataToTeam(tData,szType,tMemberInfo.szName) Output(tMemberInfo.szName)	end})
				end
			end
		end
	end
	return tOptions
end

function RaidGrid_EventScrutiny.PopRBOptions(handle)
	if not handle then
		return
	end
	
	local tTab = RaidGrid_EventScrutiny.tRecords[RaidGrid_EventScrutiny.szListIndex] or {}
