	local nAvg = RaidGrid_Base.LowAverage(tTab[nStartIndex].tEventTimeCache or {})
	local szAvg = ""
	if nAvg ~= 0 then
		szAvg = "(Trung bình: " .. RaidGrid_Base.Time2String(nAvg) .. ")"
	end
	local szLastTime = ""
	if tTab[nStartIndex].tEventTimeCache and #tTab[nStartIndex].tEventTimeCache > 0 then
		szLastTime = "(Cuối cùng: " .. RaidGrid_Base.Time2String(tTab[nStartIndex].tEventTimeCache[1]) .. ")"
	end
	
	local tTimeCache = {"Không có hồ sơ", "Không có hồ sơ", "Không có hồ sơ", "Không có hồ sơ", "Không có hồ sơ", "Không có hồ sơ", "Không có hồ sơ", "Không có hồ sơ", "Không có hồ sơ", "Không có hồ sơ"}
	if tTab[nStartIndex].tEventTimeCache then
		for i = 1, #tTab[nStartIndex].tEventTimeCache do
			if type(tTab[nStartIndex].tEventTimeCache[i]) == "number" then
				tTimeCache[i] = RaidGrid_Base.Time2String(tTab[nStartIndex].tEventTimeCache[i])
			end
		end
