		elseif tTab[nStartIndex].szType == "Npc" then
			table.insert(EventConditions, {
				szOption = "Hiển thị số lượng NPC (" .. szCount .. ")", bCheck = false, bChecked = false, bDisable = tTab[nStartIndex].szType ~= "Npc", fnAction = function(UserData, bCheck)
