			})
			table.insert(EventConditions, {
				szOption = "Khi không có mục tiêu giám sát, giám sát thời gian BOSS", bCheck = true, bChecked = tTab[nStartIndex].bNotAppearScrutiny or false, bDisable = tTab[nStartIndex].szType ~= "Npc", fnAction = function(UserData, bCheck)
					tTab[nStartIndex].bNotAppearScrutiny = bCheck or nil
				end,
			})
		end
	table.insert(EventCountdown, {
		szOption = "Thêm thông báo đếm ngược khi sự kiện xuất hiện: ", bCheck = true, bChecked = tTab[nStartIndex].bSkillTimer2Enable or false, fnAction = function(UserData, bCheck) tTab[nStartIndex].bSkillTimer2Enable = bCheck or nil end,
		{szOption = "Tên sự kiện: " .. (tTab[nStartIndex].szSkillName2 or "Không xác định"), bCheck = false, bChecked = false, fnAction = function(UserData, bCheck) GetPopupMenu():Hide(); RaidGrid_Base.GetEventSkillName2(handle) end},
		{szOption = "Thời gian đếm ngược: " .. tostring(tTab[nStartIndex].nSkillTimer2 or 0) .. " giây", bCheck = false, bChecked = false, fnAction = function(UserData, bCheck) GetPopupMenu():Hide(); RaidGrid_Base.GetEventAlertSkillTimer2(handle) end},
	})
	
	if tTab[nStartIndex].szType ~= "Buff" and tTab[nStartIndex].szType ~= "Debuff" and tTab[nStartIndex].dwID ~= 1000001 then
		table.insert(EventCountdown, {
			bDevide = true
		})
		local szLinkString = "[Không có liên kết]"
		if tTab[nStartIndex].bLinkNpcFightState and tTab[nStartIndex].szLinkNpcName and tTab[nStartIndex].dwLinkNpcTID then
			szLinkString = "[" .. tTab[nStartIndex].szLinkNpcName .. "](" .. tTab[nStartIndex].dwLinkNpcTID .. ")"
		end
		table.insert(EventCountdown, {
			szOption = "Xóa liên kết chiến đấu: " .. szLinkString, bCheck = false, bChecked = false, bDisable = not tTab[nStartIndex].bLinkNpcFightState, fnAction = function(UserData, bCheck)
				RaidGrid_EventScrutiny.LinkNpcFightState(tTab[nStartIndex], false)
			end
		})
		table.insert(EventCountdown, {
			szOption = "Lựa chọn kiểu chiến đấu với loại hình hiện tại của mục tiêu", bCheck = false, bChecked = tTab[nStartIndex].bLinkNpcFightState, fnAction = function(UserData, bCheck)
				RaidGrid_EventScrutiny.LinkNpcFightState(tTab[nStartIndex], true)
			end,
		})
		local tTimerSetOption = {
			szOption = "Đếm ngược nhiều sự kiện (Nhấp vào cài đặt)",  bCheck = true, bChecked = tTab[nStartIndex].szTimerSet or false, fnAction = function(UserData, bCheck)
				RaidGrid_Base.GetEventTimerSet(handle)
			end,
		}
		if tTab[nStartIndex].tTimerSet then
			local tTimerSetTemp = tTab[nStartIndex].tTimerSet
			for nTimerIndex = 1, #tTimerSetTemp do
				table.insert(tTimerSetOption, {
					szOption = tostring(tTimerSetTemp[nTimerIndex].nTime) .. " ==> " .. tostring(tTimerSetTemp[nTimerIndex].szTimerName),  bCheck = false, bChecked = false, fnAction = function(UserData, bCheck)
						RaidGrid_Base.GetEventTimerSet(handle)
					end,
				})
			end
		end
		table.insert(EventCountdown, tTimerSetOption)
	end
	

		
		table.insert(OtherOptions, {
			szOption = "★In info ra khung chat (giữ Alt xuất ra thành text)", bCheck = false, bChecked = false, fnAction = function(UserData, bCheck)
				RaidGrid_Base.OutputRecord(handle)
			end,
		})
		table.insert(OtherOptions, {bDevide = true})

		table.insert(OtherOptions, {
			szOption = "Bản đồ gốc: "  .. (tTab[nStartIndex].szMapName or "(Không biết)"), bCheck = false, bChecked = false, bDisable = true,
		})
		if tTab[nStartIndex].szCasterName then
			table.insert(OtherOptions, {
				szOption = "Người phóng thích kỹ năng: "  .. (tTab[nStartIndex].szCasterName or "(Không tồn tại)"), bCheck = false, bChecked = false, bDisable = true,
			})
		end
	table.insert(tOptions, {bDevide = true})
	table.insert(tOptions,EventConditions)
	
	table.insert(EventOptions,{bDevide = true})
	--table.insert(EventOptions,{szOption = "Tính năng tương tự Thể tích sáng toàn màn hình trong thiết lập giao diện",bDisable = true,})
	table.insert(EventOptions,{szOption = "Click để lựa chọn.",bDisable = true,})
	table.insert(tOptions,EventOptions)
	table.insert(tOptions,EventCountdown)
	table.insert(tOptions,OtherOptions)
	-- table.insert(tOptions, {
		-- bDevide = true
	-- })
	-- table.insert(tOptions,RaidGrid_EventScrutiny.SyncOptions(tTab[nStartIndex],nil))
	table.insert(tOptions, {
		bDevide = true
	})
	table.insert(tOptions, {
		szOption = "Ghi chú: "  .. (tTab[nStartIndex].szDescription or "(Thêm ghi chú)"), bCheck = false, bChecked = false, rgb = {210,210,210}, fnAction = function(UserData, bCheck)
			RaidGrid_Base.GetEventAddDescription(handle)
		end,
	})
	table.insert(tOptions, {bDevide = true})
	table.insert(tOptions, {
		szOption = "Xóa mục này",rgb = {255,0,0}, bCheck = false, bChecked = false, fnAction = function(UserData, bCheck)
				if tTab.Hash2[dwID] and tTab[nStartIndex].nLevel then
					tTab.Hash2[dwID][tTab[nStartIndex].nLevel] = nil
				end
				if not tTab.Hash2[dwID] or RaidGrid_Base.isTableEmpty(tTab.Hash2[dwID]) then
					tTab.Hash2[dwID] = nil
					tTab.Hash[dwID] = nil
				end
			table.remove(tTab, nStartIndex)
			RaidGrid_EventScrutiny.UpdateRecordList(RaidGrid_EventScrutiny.szListIndex)
		end,
	})
	table.insert(tOptions, {
		bDevide = true
	})
	table.insert(tOptions, {
		szOption = "Chuyển mục này lên", bCheck = false, bChecked = false, bDisable = not tTab[nStartIndex - 1], fnAction = function(UserData, bCheck)
			GetPopupMenu():Hide()
			if IsShiftKeyDown() then
				for tempii = nStartIndex, 2, -1 do
					tTab[tempii], tTab[tempii - 1] = tTab[tempii - 1], tTab[tempii]
				end
			elseif IsCtrlKeyDown() then
				for tempii = nStartIndex, math.max(2, nStartIndex - 7), -1 do
					tTab[tempii], tTab[tempii - 1] = tTab[tempii - 1], tTab[tempii]
				end
			else
				tTab[nStartIndex], tTab[nStartIndex - 1] = tTab[nStartIndex - 1], tTab[nStartIndex]
			end
			RaidGrid_EventScrutiny.UpdateRecordList(RaidGrid_EventScrutiny.szListIndex)
		end,
	})
	table.insert(tOptions, {
		szOption = "　Chuyển mục này xuống", bCheck = false, bChecked = false, bDisable = not tTab[nStartIndex + 1], fnAction = function(UserData, bCheck)
			GetPopupMenu():Hide()
			if IsShiftKeyDown() then
				for tempii = nStartIndex, #tTab - 1 do
					tTab[tempii], tTab[tempii + 1] = tTab[tempii + 1], tTab[tempii]
				end
			elseif IsCtrlKeyDown() then
				for tempii = nStartIndex, math.min(#tTab - 1, nStartIndex + 7) do
					tTab[tempii], tTab[tempii + 1] = tTab[tempii + 1], tTab[tempii]
				end
			else
				tTab[nStartIndex], tTab[nStartIndex + 1] = tTab[nStartIndex + 1], tTab[nStartIndex]
			end
			RaidGrid_EventScrutiny.UpdateRecordList(RaidGrid_EventScrutiny.szListIndex)
		end,
	})
	
	local nX, nY = Cursor.GetPos(true)
	tOptions.x, tOptions.y = nX + 15, nY + 15
	PopupMenu(tOptions)
end

Hotkey.AddBinding("RaidGrid_ES_Switch", "B/T bảng điều khiển", "RaidGrid EventScrutiny",
	function()
		RaidGrid_EventScrutiny.ToggleWindow()
	end,
	nil)

function RaidGrid_EventScrutiny.ToggleWindow()
	if not RaidGrid_EventScrutiny.wnd then
		RaidGrid_EventScrutiny.OnNotCustomDataLoaded()
	else
		if RaidGrid_EventScrutiny.IsOpened() then
			RaidGrid_EventScrutiny.ClosePanel()
		else
			RaidGrid_EventScrutiny.OpenPanel()
		end
	end
end

